INSERT INTO `faults` VALUES (1,'Karakoram Fault','Different spelling includes Karakorum Fault.','India, Pakistan, China','Tibet; Pamir; Nubra Valley; Tangtse Valley; Southern Tibet;',NULL,NULL,'1','11','Modeled slip rate: 1 mm/yr (Jay et al., 2017); GPS: 3.5 ± 5.0 mm/yr (Jade et al., 2004); InSAR: 1 ± 6 mm/yr (2σ) (Wright et al., 2004); Block Model: 4 ± 1 mm/yr (Chen et al., 2004); GPS: 11 ± 4 mm/yr (Banerjee and Burgmann, 2002)','1 ± 6 mm/yr (2σ) reported by Wright et al. (2004), spanning 8 years.','4','35','Some studies have suggested a rate as high as 30–35 mm/yr for late Quaternary slip on Karakorum fault (Avouac et al., 1993; Liu, 1993). This rate was based on offset geomorphic markers and 10 m-resolution SPOT satellite images. Gillespie and Molnar (1995), however, pointed out that these geomorphic markers may be older by a factor of 2 to 4. Brown et al. (2002) measured offsets (40 ± 5 m) on a debris-flow fan in the Tangtse Valley and dated the fan using cosmogenic nuclides (10 ± 2 ka) to estimate an average Holocene slip rate of 4 ± 1 mm/yr. Using the same technique as Brown et al. (2002), Chevalier et al. (2005a, 2005b) dated cobbles from features that they reported to be moraines, and estimated a late Pleistocene slip rate of >5.5±0.5 to >10.7±0.7 mm/yr, but Brown et al. (2005) showed that their dates favor a rate of 4–5 mm/yr.  Using different initiation ages for the Karakorum fault (14.7±1 Ma and 23±1 Ma) and a 149-176 km of displacement of the Aghil limestone along the northern section of the fault, Robinson (2009) estimated long-term slip rates of 10.8 ± 1.3 mm/yr and 6.8 ± 0.8 mm/yr respectively.  Based on offset terraces, Chevalier et al. (2011b) estimated a minimum Holocene slip-rate of >9 mm/yr across the Karakorum fault system.','Brown et al. (2002) mapped surface features with 2-m and 40-m offsets in close proximity in the Tangtse Valley, implying that a recent large earthquake activated a section of the fault that has been repeatedly active in the past. They noted that the 2-m offset occurred in a single earthquake with a magnitude of 7. There is, however, no historical record of a significant earthquake on the Karakorum fault (Gutenberg and Richter, 1954). This implies that such an event as observed by Brown et al. (2002) occurred before 1900.\r\n\r\nIf the 2-m offset represents a single seismic event, this rate corresponds to a recurrence interval of 500 years for such earthquakes at this site, or proportionally shorter intervals for smaller events (Brown et al., 2002). ','Searle (1996) examined the pre-Holocene geology along the Karakoram fault to ascertain the timing and amounts of offset along the fault. To do this, he divided the fault into three segments. In the northern segment (39-36 degrees N) in the Pamirs, the fault has dominantly normal fault motion, little dextral strike-slip offset, and little influence over topographic uplift or high exhumation rates. In the central segment (36-34 degrees N) in the Karakoram Range, the fault shows the maximum amounts of dextral movement, but the geological offsets (85-90 km) of the Miocene Baltoro granite intrusions and the Shyok-Bangong suture zone are relatively small. In the southern section (34-31 degrees N) in southwest Tibet, the fault offsets the Indus River by 120 km dextrally. No other geologic evidence for any greater offsets on either side of the fault was found.   \r\n\r\n  ',NULL,NULL,NULL,'Dextral (right lateral); Strike-slip','With a normal component. See comments under geomorphic field.',NULL,NULL,'>1000','',NULL,NULL,NULL,'Jade et al. (2004); Wright et al. (2004); Avouac and Tapponnier (1993); Liu (1993); Brown et al. (2002); Brown et al. (2005); Chevalier et al. (2005a); Chevalier et al. (2005b); Chevalier et al. (2011b); Gillespie and Molnar (1995); Searle (1996); Gutenberg and Richter (1954); Chen et al. (2004); Banerjee and Burgmann (2002)','2020-04-08 12:04:55'),(2,'North Pamir Thrust','Also referred to as the Main Pamir Thrust, the Main Alai Thrust, the Trans Alai Thrust, and the Pamir Thrust System (Burtman et al., 1993; Hamburger et al., 1992; Cowgill, 2010; Schurr et al., 2014). Also see Vakhsh thrust system which is an active thrust front of the Pamir thrust system (Schurr et al., 2014).','Tajikistan, Kyrgyzstan, China','Trans Alai Range; Alai Valley; Pamir; Southern Tien Shan',NULL,NULL,'10','15','A modeled slip rate of ~12 mm/yr was calculated by Jay et al. (2017) by averaging velocity pair differences across the Pamir Frontal and Main Pamir thrusts.  \r\n\r\nLocalized shortening across the Trans-Alai Thrust is estimated to be 10-15 mm/yr (Ischuk et al., 2013). Mohadjer et al. (2010) also estimated an upper bound on total shortening in the combined Central Alai and northernmost Pamir of 11.8 ± 2 mm/yr. Reigber et al. (2001) reported a shortening rate of 13 ± 4 mm/yr across the eastern end of the Alai Valley between Kara Kul and the Ferghana Valley. The GPS network, however, remains to be spars and does allow constraining where and how this strain accumulated across the faults and folds of the Pamir thrust system.  \r\n',NULL,'2','6','Arrowsmith et al. (1999) estimated a preliminary minimum Holocene dip-slip rate of about 6 mm/yr for the 50-km-long, east-west-striking central segment of the Main Pamir thrust, between the Adziktash River in the east and the Kokkik River in the west. This rate is based on the offset history of a fluvial terrace, and is compatible with the 2-4 mm/yr rate estimated by Nikonov et al. (1983) and Burtman and Molnar (1993) which is based on the overthrusting of Stone Age artifacts farther west. Coutand et al. (2002) determined horizontal shortening rates across the Alai Valley of 0.7-0.8 mm/a since 25 Ma ago using balanced cross sections, although these sections yield minimum estimates of total shortening (and thus minimum rates) because they do not account for slip along basement-involved thrusts at the ends of the sections (Cowgill, 2010).\r\n\r\n','The main moment release of the 2008 Nura earthquake of magnitude 6.6 appears to be on the Pamir Frontal thrust, with surface displacements and rupture along the Irkeshtam fault (Teshebaeva et al., 2014). Schurr et al. (2014) suggest the central part of the thrust system to be either locked or creeping, with minor seismic deformation in the eastern segment of the Pamir thrust system along the border with the Tarim Basin (e.g., the 2008 Nura earthquake cluster).    ','Geomorphic features include gravel-covered and offset perdiments and terraces (Strecker et al., 1995). ',NULL,NULL,NULL,'Thrust','The central segment of the Main Pamir thrust has a motion that is predominantly dip-slip (Arrowsmith et al., 1999).','South','The central segment dips southward between 30 and 45 degrees (Arrowsmith et al., 1999).',NULL,'',NULL,NULL,'The Main Pamir Thrust is a system of Quaternary faults that accommodates shortening on the north side of the Pamir. It separates the Trans Alai Range from the intramontane Alai Valley. The Trans Alai Range defines a section of the Main Pamir thrust, which is divided into eastern, central and western segments, each recording different absorption of the India-Eurasia plate convergence. Each section is described in more detail by Arrowsmith et al. (1999). \r\n\r\nThis fault may be the surface expression of the south-dipping deep-earthquake slab (Fan et al., 1994). Crustal shortenning across the Alai system is estimated from GPS as 11.8 +/- 2 mm/yr (Mohadjer et al., 2010). Arrowsmith et al. (1999) determined a preliminary slip rate along the Main Pamir thrust of 6 mm/yr on the basis of the offset history of a fluvial terrace, implying that this narrow sector accommodates a minimum 10% of the India-Eurasia shortening.\r\n\r\nSome of the fault traces are based on a map produced by Arrowsmith and Strecker (1999) which was modified after Kyrgyz Geodetic and Cartographic Agency 1991). Other fault traces come from Coutand et al. (2002), Schurr et al. (2014), and Teshebaeva et al. (2014).   ','Ischuk et al. (2013); Yeats (2012); Mohadjer et al.(2010); Arrowsmith and Strecker (1999); Burtman and Molnar (1993); Nikonov et al. (1983); Coutand et al. (2002); Cowgill (2010); Strecker et al. (1995); Reigber et al. (2001); Hamburger et al. (1992); Schurr et al. (2014)','2018-04-30 13:39:44'),(3,'Darvaz-Karakul Fault','Darvaz Fault Zone (Schurr et al., 2014)','Tajikistan, Afghanistan ','Pamir, Tajik Depression; North Afghan Platform ',NULL,'It lacks clarity along much of its trace (Molnar et al., 2010).','6','15','Ischuk et al. (2013) estimated 10 ± 1 mm/yr of sinistral shear accommodated by the Tajik Depression margin which may be localized entirely on the Darvaz-Karakul fault. Mohadjer et al. (2010) estimated a 11.4 ± 2 mm/yr of sinistral shear using velocity components between GPS sites located parallel to the mean strike of the fault (N5 degree E). They estimated this rate as a maximum because of reported evidence for late Quaternary strike-slip displacement along some faults in the Tajik Depression. Jay et al. (2017) calculated a modeled slip rate of 6 mm/yr by averaging velocity pair differences across the fault. Metzger et al. (2020) obtained 10-15 mm/yr sinistral slip and ~10 mm/yr of E-W extension for the Darfaz fault.\r\n\r\n',NULL,'10','15','Kuchai and Trifonov (1977) and Trifonov (1978) estimated a rate of 10-15 mm/yr. This left-slip rate is based on displaced landforms of probable Holocene age (Burtman and Molnar, 1993, and references therein).    \r\n\r\nOffset stream valleys of 5 m and of 20 m as well as similar offsets of stone walls built during/since Sogdian time (sixth to twelfth centuries) made Kuchai and Trifonov (1977) and Trifonov (1978) infer a maximum age of ~1500 yr, implying a minimum rate of 13 mm/yr for 20 m offsets. They also noted offsets of  \r\n60–95 m for late Holocene features, 150–160 m for Holocene features, and\r\n300–350 m for late Pleistocene features, and perhaps 800 m since the beginning of late Pleistocene time, all consistent with a rate of 10–15 mm/yr. \r\n\r\nThe ages of these features, however, do not appear to be well constrained and must be considered qualitative at best (Schurr et al., 2014; Cowgill, 2010; Molnar et al., 2010).','In a seismotectonic study of the Pamir, Schurr et al. (2014) located a group of only three strike-slip earthquakes affiliated with the Darvaz fault zone, and only a few more further south that are too small for focal mechanism determination. According to Metzger et al. (2020), the 2015 Mw7.2 Sarez earthquake may have triggered ~2 cm of slip on the Darvaz fault reverse to its interseismic loading sense.\r\n','Deflections of modern, active stream channels (Ruleman et al., 2007); offsets of Holocene and late Pleistocene landforms, especially early Holocene terraces and alluvial fans (Kuchai and Trifonov, 1977; Trifonov, 1978)\r\n',NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)','Thomas et al. (1994) show the Darvaz fault as a thrust fault. \r\n ','East',NULL,'<300','Molnar et al. (2010)','Northeast',NULL,'This fault may connect southward with the northern end of the Chaman and Gardez fault system in Afghanistan. According to Ruleman et al. (2007), at the northern border of Afghanistan, the Darvaz-Karakul fault is truncated by northwest-trending, strike-slip fault zones. In Tajikistan, this fault is associated with continuous, north- to northeast-trending, range-bounding fault scarps on piedmont alluvium. Normal faults are present as stepovers and jogs along the fault.\r\n\r\nTapponnier et al. (1981) suggested that the Panjshir and Darvaz-Karakul faults to be the northermost extensions of the Chaman fault system.  \r\n\r\nSchurr et al. (2014) suggest that the recent activity along this fault zone likely extends into the rear of the Pamir thrust system.\r\n','Ischuk et al. (2013); Cowgill (2010); Mohadjer et al. (2010); Ruleman et al. (2007); Thomas et al. (1994); Kuchai and Trifonov (1977); Trifonov (1978); Molnar et al. (2010); Tapponnier et al. (1981); Schurr et al. (2014);','2020-06-18 11:34:07'),(4,'Talas-Fergana Fault','Also known as Talas-Ferghana fault. Also see: Karatau fault','Kyrgyzstan, Khazakhstan, China','Tien Shan; Fergana Valley','Exposed ','The Talas-Fergana is obvious on both\r\naerial photos (Burtman, 1963, 1964, 1975; Trifonov, 1978) and satellite imagery (Tapponnier and Molnar, 1979).','0','2','GPS measurements show a slip rate of less than 2 mm/yr at the eastern end of the Ferghana Valley (Meade and Hager, 2001; Mohadjer et al., 2010; Zubovich et al., 2007 and 2010; Reigber et al., 2001).',NULL,'2','19','Burman et al. (1996) sampled organic materials at 18 localities where the fault scarp of the Talas-Ferghana fault has blocked drainage. In 6 localities, they obtained organic material where they could measure offset gullies and ridges that predate the organic material by an unknown period of time. Four ratios of offset to apparent age yield Holocene rates within the range of 8-16 mm/yr. Ratios presented by Trifonov et al. (1990, 1992) overlap this range. Radiocarbon dates in the Chatkal Ranges and elsewhere along the fault collectively suggest similar apparent rates of 10-16 mm/yr. These apparent slip rates are strictly upper bounds to the late Holocene slip rate. The slip rate is no more than 15 mm/yr, and no more than 10 mm/yr except perhaps in the northwesternmost part of the region, adjacent to the Chatkal Ranges. The preponderance of apparent rates overlapping 6-16 mm/yr suggests that the average slip rate is close to this upper bound and therefore 10 mm/yr.\r\n\r\nKorjenkov et al. (2012) estimated a Holocene and Late Pleistocene dextral movement of 0.2-1.9 cm/yr based on data of absolute dating.  \r\n\r\nRust et al. (2018) documented late Holocene slip rates of 11-16 mm/yr. These rates are based on C14 dating of multiple samples taken from Sary-Bulak and Usta-Say sites.','The epicenter of the 1946 Chatkal earthquake of M 7.5 was estimated to be close to the fault (Yeats, 2012). Previous studies based on teleseismic events (Ghose et al., 1998) and seismicity observed along the fault from a local network (Feld et al., 2015) show very sparse seismicity associated with the fault, suggesting that the fault might be locked or aseismically creeping (Feld et al., 2015). ','Late Quaternary offset features have been measured by Burtman et al. (1996).',NULL,'The fault zone according to Korjenkov et al. (2012) is marked by well-developed paleoseismic deformations including up-slope facing scarps, fault scarps, and horizontal displacements of the relief forms. Using radiocarbon dating, they located more than 18 strong earthquakes along the fault zone during interval of 275-15,800 years, and concluded a 300 years of reoccurrence interval for strong earthquakes for the second part of Holocene, with next earthquake to occur in the south-eastern segment of the fault (between the Kyldau River valley and Kyrgyzstan border) in the nearest tens of years. More ',NULL,'Dextral (right-lateral); Strike-slip ',NULL,NULL,NULL,'800-2000 km','Another segment, the Karatau fault, marks a northwest continuation for at least another 300 km. The combined length of 800 km for the Karatau-Ferghana fault system maybe a minimum for this zone (Burtman et al., 1996). The fault is reported as one of the largest intracontinental strike-slip faults on Earth, with a length of about 2000 km, extending from the western Tarim Basin to the Turgay Basin (Bande et al., 2015). ',NULL,NULL,'The fault forms the obliquely oriented boundary between the central Tien Shan, east of the fault, and the western Tien Shan, which includes the Ferghana Valley, the Chatkal Ranges, and the Alay Ranges. The Talas-Fergana fault seems to be a part of a much longer zone with a history that apparently began before the Cenozoic Era. The fault offsets the mostly Paleozoic rock units that lie  in the Chatkal Ranges west of the fault and farther south of the east side, in the interior of the central Tien Shan (Burtman et a;., 1996). It terminates in the northwest, where slip is transformed into crustal shortening in the Chatkal Ranges. \r\n','Yeats (2012); Mohadjer et al. (2010); Burtman et al. (1996); Reigber et al. (2001); Burtman (1963); Burtman (1964); Burtman (1975); Trifonov (1978); Tapponnier and Molnar (1979); Zubovich et al. (2007); Zubovich et al. (2010); Molnar et al. (2010); Korjenkov et al. (2012); Rust et al. (2018)','2018-06-08 13:29:16'),(5,'Issyk-Ata Fault',NULL,'Kyrgyzstan','Chu Basin, Central Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,'0.7','2.1','The slip rate of 2.1 +1.7/-0.3 mm/yr is estimate by Thompson et al. (2002) on the central portion of the fault, where it crosses the Alamedin River. Patyniak et al. (2017) estimated a minimum late Pleistocene slip rate of 0.7 ± 0.2 mm/yr at Belek, where a morphologically well-expressed fault scarp cuts through an alluvial fan, ~25 km southwest of Bishkek. \r\n',NULL,NULL,'A trench has been excavated at Belek, ~25 km southwest of Bishkek, revealing three (Holocene) paleoearthquakes (see Patyniak et al., 2017). The approximate location is 42.83 N, 74.31 E.     ','Patyniak et al. (2017) identified at least three surface-rupturing paleoearthquakes with magnitudes between M6.7 and 7.4 at a trench (Belek site) along the Issyk-Ata fault. \r\n\r\n',NULL,'Thrust; Reverse',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'This faults defines the northern deformation front of the central Tien Shan. It extends 120 km from the Aksu River east to its surface termination near the Shamsi River, and merges at its western terminus with the Chonkurchak fault, which marks the boundary between pre-Cenozoic basement at the Kyrgyz Range front and late Cenozoic deposits in the western Chu basin. The fault places Neogene sandstone and siltstone over Quaternary gravel and has been interpreted by Thompson et al. (2002) as a splay from Shamsi-Tunduk/Chonkurchak fault beneath the southern margin of the Chu basin. \r\n','Thompson et al. (2002), Patyniak et al. (2017)\r\n','2018-04-30 10:32:20'),(6,'South Kochkor Fault',NULL,'Kyrgyzstan','Central Tien Shan, Kochkor Basin',NULL,NULL,NULL,NULL,NULL,NULL,'0.2  ',NULL,'The slip rate of 0.2 +0.9/-0.03 mm/yr for the South Kochkor Fault was calculated from measurements of a deformed late Quaternary terrace (Thompson et al. (2002).\r\n',NULL,'Offset terraces ',NULL,NULL,NULL,NULL,NULL,'30-70 south','The dip is presented by a trapezoidal probability distribution with a maximum likelihood of 30-70 degree south.\r\n',NULL,NULL,NULL,NULL,'The South Kochkor fault follows the southern margin of the Kochkor basin, placing Paleozoic metemorphic and igneous rock of the Terskey Ala-Too over weakly cemented Neogene sedimentary rocks. The fault cuts late Quaternary terraces and alluvial fans, but most of the  late Quaternary deformation occurs several kilometers to the north, within the basin. ','Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(7,'Akchop Hills Fault',NULL,'Kyrgyzstan','Central Tien Shan, Kochkor Basin',NULL,NULL,NULL,NULL,NULL,NULL,'2.9 ',NULL,'Calculated from measurements of a deformed late Quaternary terrace; Thompson et al. (2002) surveyed profiles along three river terraces and mapped the underlying strata on the west side of the Djuanarik River to evaluate the subsurface geometry and rate of dip-slip on this fault which was estimated to be 2.9 +1.6/-0.7.  \r\n',NULL,'Deformed Quaternary terraces along the west side of the Djuanarik River (Thompson et al., 2002)',NULL,NULL,NULL,'Thrust',NULL,'South',NULL,NULL,NULL,NULL,NULL,NULL,'Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(8,'Kadjerty Fault',NULL,'Kyrgyzstan','Naryn Basin, Kyrgyz Tien Shan, Central Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,'1.5',NULL,'Thompson et al. (2002) estimated a slip rate of 1.5 +0.4/-0.3 mm/yr.',NULL,'Fault scarps cut nested terraces.',NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,'100','Continuous for ~100 km, with the mapped trace extending farther west.\r\n',NULL,NULL,NULL,'Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(9,'Central Naryn Fault',NULL,'Kyrgyzstan','Naryn Basin, Kyrgyz Tien Shan, Central Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,'2.3',NULL,'2.3 +0.3/-0.4 mm/yr (Thompson et al., 2002) \r\n',NULL,'The fault cuts and deforms terraces west of the Kadjerty River.',NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,'100','Continuous for ~100 km, with the mapped trace extending farther east.\r\n',NULL,NULL,NULL,'Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(10,'Oinak-Djar Fault',NULL,'Kyrgyzstan','At-Bashi Basin, Central Tien Shan','Exposed','Concealed along its eastern portion. \r\n',NULL,NULL,NULL,NULL,'0.9',NULL,'0.9 ± 0.3 mm/yr (Thompson et al., 2010)',NULL,'Fault scarps visible on ground surface.','Thompson et al. (2002) excavated a trench across the fault where the fault has offset the head of an alluvial fan repeatedly during the late Quaternary Period.  \r\n',NULL,NULL,'Thrust','Minor component of left-lateral shear as indicated by right-stepping en echelon fold axes in the hanging wall of the fault and deflected drainages. \r\n',NULL,NULL,'80',NULL,NULL,NULL,'This fault appears to accommodate most of the late Quaternary shortening across the western and central At-Bashi basin. \r\n','Makarov (1977); Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(11,'North Kyrkungey Fault',NULL,'Kyrgyzstan','Aksay Basin','Exposed, concealed ','The fault does not reach the surface in all locations or it consists of several short segments.\r\n',NULL,NULL,NULL,NULL,'0.1 ',NULL,'Thompson et al. (2002) observed evidence for recent surface ruptures a long the fault trace, but small cumulative displacement of less than a few meters across older late Quaternary suggests that the late Quaternary slip rate is low: 0.1 +1.1/-0.07. \r\n',NULL,'Thompson et al. (2002) reported that \r\nthis fault displaces the heads of small Holocene fans and terraces. There is no evidence of recent surface faulting elsewhere along its trace. However, an aligned row of folds to the northwest indicates that late Quaternary deformation continues along strike. \r\n',NULL,NULL,NULL,'Thrust',NULL,'Between 20 and 40 degrees south',NULL,NULL,NULL,NULL,NULL,NULL,'Thompson et al. (2002)\r\n','2015-07-15 14:18:00'),(12,'South Kyrkungey Fault',NULL,'Kyrgyzstan','Central Tien Shan ',NULL,NULL,NULL,NULL,NULL,NULL,'0.2 ',NULL,'0.2 +0.9/-0.1 mm/yr (Thompson et al., 2002) ',NULL,'The fault has displaced a broad terrace (vertical separation of 24 +/- 5 m) that is between 40 and 75 m above the modern Kashkasu and Bogoshti-Kakasu rivers. From air photo analysis and field observations, Thompson et al. (2002) infer the age of the terrace from stratigraphic relationships and correlation to dated terraces in other intermontane basins. The eastward continuation of this fault into the Kashkasu River valley does not appear to cut an inset terrace or to interrupt the same low terrace that is cut by the North Kyrkungey fault, supporting the interpretation of a low slip rate. Numerous gullies along the fault scarp face are deflected left laterally about 1-2 m.\r\n',NULL,NULL,NULL,'Sinistral (left lateral) and Thrust','Thompson et al. (2002) noticed numerous left-laterally deflected gullies along the scarp face, indicating a component of\r\nsinistral slip.',NULL,NULL,NULL,NULL,NULL,'\r\n',NULL,'Thompson et al. (2002) ','2015-07-15 14:18:00'),(13,'Chaman Fault','Also known as the Chaman Fault System. Ruleman et al. (2007) subdivided the system into four subsidiary systems including Chaman fault, Mokur fault, Gardiz fault, and Paghman fault\r\n','Afghanistan, Pakistan',NULL,'Exposed',NULL,'5.4','16.8','Based on geodetic observations, E. Apel (written commun., 2006, in Yeats, 2012) reported 26 mm/yr for the Chaman fault. This rate is close to that of 29.7 mm/yr predicted for relative movement of India toward Eurasia in this region (Sella et al., 2002).\r\n\r\nMohadjer et al. (2010) used differences in velocities between GPS sites spanning most of the northern end of the Chaman Fault and placed a lower bound on the slip rate of 18 ± 1 mm/yr across this region. Furthermore, they estimated a rate of 5.4 ± 2 mm/yr of sinistral shear across the Gardiz and Mokur faults at the northern section of the Chaman Fault zone.  \r\n\r\nContinental scale geodesy indicates that India\'s relative velocity with respect to Eurasia at the longitude of the Chaman fault system is 24-28 mm/yr of which 15.1 mm/yr is accommodated by the Ornach Nal fault and the central and southern Chaman fault (Szeliga et al., 2012). \r\n\r\nAt latitude 33 degrees N and further north, InSAR data indicate a velocity across the Chaman fault of 16.8 ± 2.7 mm/yr near Qalat, Afghanistan (Szeliga et al., 2012). Based on GPS observations, the authors also reported 16.8 ± 0.51 mm/yr of sinistral motion near Kabul, Afghanistan.  \r\n\r\nJay et al. (2017) calculated a modeled slip rate of 10 mm/yr by averaging velocity pair differences across the fault.\r\n','At latitude 33 degrees N and further north, InSAR data indicate a velocity across the Chaman fault of 16.8 ± 2.7 mm/yr near Qalat, Afghanistan (Szeliga et al., 2012). Based on GPS observations, the authors also reported 16.8 ± 0.51 mm/yr of sinistral motion near Kabul, Afghanistan.  ','2','40','Based on the degree of topographic disturbance caused by the fault, Wellman (1965) suggested a present-day average slip rate of 2-20 mm/yr.\r\n\r\nBeun et al. (1979) suggested an average slip rate of 25-35 mm/yr over the last 2 My across the whole fault zone based on the correlation of Pliocene offset of volcanic units that straddle the fault north of Ab-e-Istada in Afghanistan. \r\n\r\nGeologic and plate closure estimates suggest sinistral slip across the Chaman fault system of between 19 and 35 mm/yr over the last 25 Ma (Lawrence and Yeats, 1979).\r\n\r\nNUVEL-1 global plate motion model of DeMets et al. (1990) predicts a rate of about 40 mm/yr for the Chaman Fault. \r\nLawrence et al. (1992) reported 19-24 mm/yr over the last 20-25 My as a minimum slip rate assuming slip began just after the end of deposition of the Khojak Flysch. \r\n\r\nYeats (2012) concluded that the slip rate on the Chaman Fault is high enough that the next earthquake is overdue, even assuming that some of the plate boundary slip  maybe aseismic or on slow earthquakes. \r\n\r\nAlthough poorly constrained, Molnar et al. (2010) believe that the rate of slip on the Chaman Fault is >10 mm/yr and most likely between 20 and 30 mm/yr. \r\n','There are at least four major strike-slip earthquakes with M > 6 recorded historically on the Chaman fault: the 1505 earthquake (Ms 7.3) west of Kabul, the 1892 (Ms. 6.5) earthquake near the city of Chaman, the 1975 earthquake between Chaman and Nushki and the 1978 earthquake north of Nushki in Pakistan.\r\n\r\nNo major historical earthquakes are noted between the 1892 Chaman rupture to the southern terminus of the 1505 rupture which made Bernard et al. (2000) and Ambraseys and Bilham (2003b) conclude that a significant slip deficit exists along the Chaman fault, especially north of ~31 degree latitude.   \r\n\r\nThe region east of the Chaman fault underwent two large earthquakes, the Mach earthquake of 27 August 1931 of Ms 7.3 in the Sibi re-entrant between the Brahui and Sulaiman ranges, and the Quetta earthquake of 30 May 1935 of Ms 7.7. The epicenter of the Quetta earthquake was close to the Ghazaband fault. Ambraseys and Bilham (2003a), however, were unable to attribute the reported surface deformation to a source fault. \r\n\r\nRecent seismicity along the fault appears to be mostly small earthquakes (M 3-5), located mostly in regions with major historical seismicity. The M5 earthquake in 2005 ruptured the surface along the 6.5 km of the Chaman fault south of Kabul. The slow slip observed over a year after this event raises the possibility that other parts of the fault might rupture in slow slip events (Yeats, 2012). \r\n','Earthquakes along the Chaman fault appear to consistently rupture to the surface. Oldham (1883) and Babur (1912) reported surface ruptures for the 1505 earthquake near Kabul. Griesbach (1893) observed surface rupture from the 1892 Chaman earthquake which offset railroad tracks crossing the fault by 0.75 m. No surface rupture has been reported for the 1975 Ms 6.7 earthquake which occurred between Nushki and Chaman in Pakistan. The 1978 Mw 6.1 earthquake near Nushki ruptured the surface (Yeats et al., 1979). \r\n\r\nWellman (1965) reported stream offsets of 20-120 m. Active fault features consistent with the 1892 surface rupture are described by Lawrence and Yeats (1979).\r\n',NULL,NULL,NULL,'Sinistral (left-lateral); Strike-slip','Ruleman et al. (2007) reported active frontal thrust faults along western margin of the Chaman fault. These arcuate, northwest-directed, east-dipping, frontal thrusts are second-order structures that result from the combination of compression and strike-slip motion on the Chaman fault system. Some of these thrust faults are >20 km long and extend >10 km west of the main fault trace. Multiple strike-slip fault strands are proximal to these thrust faults.\r\n',NULL,NULL,'> 850 km',NULL,NULL,NULL,NULL,'Yeats (2012); Lawrence et al. (1992); Griesbach (1893); Ambraseys and Bilham (2003b); DeMets et al. (1990); E. Apel (written commun., 2006); Lawrence and Yeats (1979); Szeliga et al. (2012); Beun et al. (1979); Wellman (1965); Molnar et al. (2010); Sella et al. (2002)   \r\n','2018-04-30 13:32:20'),(14,'Hari Rud Fault; Herat Fault','Also known as the Hari Rud Fault System, and the Herat Fault.','Afghanistan','North Afghan Platform','Exposed','Wellman (1965) considered the Herat fault to be well-defined and traceable for almost the whole width of the north part of Afghanistan. \r\n\r\nThe fault can be traced from west of 61°E near Herat, to meet the Chaman fault system at 69°E, north of Kabul. It then curves to the NE for 400 km continuing the approximate curve of the Chaman fault system (Ambraseys and Bilham, 2009).','','<2','Mohadjer et al. (2010) reported a lack of present-day active slip by observing a sinistral shear rate of 6.4 ± 2 mm/yr between GPS sites in Kabul (Afghanistan) and Shartuz (Tajikistan), opposite in sense to geologic interpretations that show dextral slip on the Herat fault. \r\n',NULL,'2','3','The velocity along the Harat fault amounts to 2-3 mm/yr based on aerial and satellite\r\nphotographic evidence of average 5 km offsets of Upper Pliocene age (Sborshchikovet al., 1982). ','There is little evidence that the Hari Rud fault is active, although an earthquake of Mw 7.4 on 9 June 1956 in the Bamian Valley struck a region not far from the fault.This earthquake occurred in a block bounded by the Andarab fault and the Herat fault, with no mapped fault in between these two faults. There are also no reports of surface rupture on any of the faults in the region. \r\n\r\nLimited field studies suggest that at least the eastern part of the fault has not been active since Miocene time (Tapponnier et al., 1981). According to Ambraseys and Bilham (2009), the western part of the fault has also remained largely inactive historically. However, the apparent absence of large earthquakes on the Herat fault for the past 1200 years should not be taken to imply that large events cannot occur (Ambraseys and Bilham, 2009). \r\n','This fault is sharply expressed in the Quaternary morphology .\r\n\r\nWellman (1965) located twelve streams displaced dextrally, six by 60 m to 100 m about 200 km northeast of Kabul and near the point of inflextion.  The streams are reported to be probably no more than 10,000 years old. He also located several tailing streams about 500 km west of Kabul,  showing dextral displacement. According to his observations, the vertical displacement is much less than the horizontal displacement along this fault.  \r\n\r\nNarrow elongated basins filled with Oligo-Miocene continental sediments might suggest that the fault was mainly active during this period (Lang, 1972 and 1977; Tapponnier et al., 1981).  \r\n\r\nPost-Miocene deposits are not clearly offset along the fault, and evidence of present-day right-lateral displacements have only been found along the parallel Andarab fault to the north (Wellman, 1979; Tapponnier et al., 1976). \r\n\r\n',NULL,NULL,NULL,'Dextral (right lateral); Strike-slip','The horizontal slickensides in Cretaceous and Eocene sediments as well as the linearity of the fault over hundreds of kilometers support predominant strike-slip movements along it (Tapponnier et al, 1981) with right lateral sense of motion based on microtectonic observations (Tapponnier and Molnar, 1976).',NULL,NULL,'>1000','Wellman (1965) reported a total length of at least 1100 km for the Herat fault. Ambraseys and Bilham (2009) noted a length of 1200 km.  \r\n',NULL,NULL,'The Hari Rud fault is an east-west suture through central Afghanistan, trending northward into the Hindu Kush mountains north of Kabul at its eastern end. It marks the boundary between the stable Turan Platform to the north and the Helmand Block to the south. North of Kabul, the Chaman fault intersects the Herat fault with evidence of right-lateral offsets. \r\n','Mohadjer et al. (2010); Ruleman et al. (2007); Wellman (1965); Ambraseys and Bilham (2009); Lang (1972, 1977); Tapponnier et al. (1981); Tapponnier and Molnar (1976); Sborshchikovet al. (1982); \r\n\r\n','2015-07-21 12:57:17'),(15,'Ghazaband Fault','It is sometimes referred to as the Ghazaband Fault Zone. Also, See Chaman Fault System. ','Pakistan',NULL,NULL,NULL,NULL,'22','Szeliga et al. (2012) measured a total rate of about 22 mm/yr of sinistral motion between Chaman and Sukkur towns in Pakistan, to the east of the Seistan ranges. This shear motion can be accommodated entirely by slip on the Ghazaband fault or by block rotation or distributed shear in the Seistan Ranges to the east. ',NULL,NULL,NULL,NULL,'The epicenter of the Quetta earthquake of Ms 7.7 (1935) was close to the Ghazaband fault as mapped by Lawrence et al. (1992) although they did not attribute it to the fault. Several authors, however, reported slip on this fault to be responsible for most of the damage caused by the Quetta earthquake (Engdahl and Villasenor (2002); Cox et al., 1936; Skrine, 1936; Ramanathan and Mukherji, 1938; Pinhey, 1938). \r\n\r\nSlip in the 1892 Chaman earthquake has been measured in one location as 75-80 cm which suggests a renewal time for earthquake recurrence of 100 years, with large uncertainty (Szeliga et al., 2012).\r\n','Offsets of streams and scarps in alluvium (Lawrence et al., 1992)\r\n',NULL,NULL,NULL,'Sinistral (left lateral); Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Ghazaband fault is one of the three major left-lateral left-stepping faults that account for most of the north-south length of the Chaman fault system. It extends from the northern terminus of the Ornach-Nal fault and continues northward to the town of Pishin where it disappears into the southern end of the seismically quiet Katawaz Block (Haq and Davis, 1997).\r\n\r\nThe Ghazaband fault separates deformed shelf strata on the east and Khojak Flysch on the west.\r\n','Szeliga et al. (2012); Lawrence et al. (1992); Cox et al. (1936); Skrine (1936); Ramanathan and Mukherji (1938); Pinhey (1938); Haq and Davis (1997); Yeats et al. (1997); Ambraseys and Bilham (2009) \r\n\r\n','2015-07-15 14:18:00'),(16,'Ornach-Nal Fault','The Ornach Nal Fault is the southern most on-land segment of the Chaman Fault System.','Pakistan',NULL,'Exposed','The Ornach-Nal fault can be traced southwards along the western edge of the Somniani depression toward an offshore triple junction between the Arabia, India and Eurasia Plates (Szeliga et al, 2012).','15.1','30','The displacement rate on the Chaman/Ornach Nal system, measured by GPS, was estimated to be ~ 3 cm/yr by Khan et al. (2008).\r\n\r\nAt the longitude of the Chaman fault system, 15.1 mm/yr of total India\'s relative velocity with respect to Eurasia is accommodated by the Ornach Nal fault and the central and southern Chaman fault (Szeliga et al., 2012). ',NULL,NULL,NULL,NULL,'Historically, the Ornach-Nal region has been seismically quiet (Zaigham, 1991; Lawrence et al., 1992) and the International Seismological Center lists no earthquakes larger than Mb 4.9 near the Ornach-Nal fault for the period of 1972-2010. \r\n\r\nDewey (2006), however, reports that the Kirthar Range, including the Ornach-Nal fault, experiences moderate seismicity, but none of the seismicity has been attributed specifically to the Ornach-Nal fault.\r\n\r\nAccording to Szeliga et al. (2012), the Ornach Nal fault is apparently locked in its uppermost 3 km, reducing the accumulation of a significant seismic moment deficit, resembling the creeping and transition parts of the San Andreas and Hayward faults, except that no surface creep has been reported from Afghanistan.  \r\n\r\n\r\n\r\n','There are sag ponds, scarps in alluvium, left-laterally offset streams, and extrusive mud along 35 km of the central section of the fault (Yeats, 2012).\r\n\r\nThe fault offsets primarily Cenozoic mudstones and shales, but the total offset across the fault remains to be impossible (Szeliga et al., 2012)  \r\n',NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)','Left-lateral, left-stepping ',NULL,NULL,'250',NULL,NULL,NULL,'The Ornach-Nal fault is the southernmost on-land segment of the Chaman fault system. It appears to be a left stepover from the Ghazaband fault, which ends southward near where the Ornach-Nal fault begins. It extends southward from a fold structure known as the Khuzdar Knot 260-275 km to the Arabian Sea (Lawrence et al., 1992).\r\n','Szeliga et al. (2012); Lawrence et al. (1992); Zaigham (1991);','2015-07-15 14:18:00'),(17,'Shyok Suture Zone','Also named Main Karakoram Thrust. ','Pakistan; Afghanistan; India',NULL,NULL,NULL,NULL,NULL,'North of the Deosai and Kohistan Plateaus, recorded velocities on either side of the Main Karakoram Thrust do not reveal a significant velocity gradient. This could indicate a lack of significant deformation along this major thrust and that this area clearly lies above an active ductile thrust allowing its passive transportation (Jouanne et al., 2014).',NULL,NULL,NULL,NULL,'Data suggest release of stresses along the Indus Stuture Zone, Shyok Suture Zone, and the Karakoram fault in the form of earthquakes between 35,000 yr BP to approximately the Last Glacial Maxima (Phartiyal and Sharma, 2008).\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Shyok suture zone separates the Kohiston-Ladakh terrane to the south from the Karakoram terrane to the north and connects with the Karakoram fault at the junction of the Nubra and Skyok valleys. \r\n','Taylor and Yin (2009); Searle (1996); Jouanne et al. (2013); Phartiyal and Sharma (2008)','2015-07-15 14:18:00'),(18,'Karatau Fault','Also see: Talas-Fergana Fault\r\n','Kazakhstan','Tien Shan','concealed in some locations ','The fault is buried under Quaternary sediment farther northwest. Afanas\'yeva et al. (1983) reported that from satellite imagery they could trace unspecified features, collectively termed a \"lineament\" and presumed to be a northwestward continuation of the Karatau-Talas-Ferghana fault, to the Ural Mountains, >1000 km to the northwest.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Dextral (right lateral)',NULL,NULL,NULL,'300',NULL,NULL,NULL,'The Karatau fault is a segment of the Talas-Fergana fault, and makes a northwest continuation for at least 300 km. Orientations of folds in Paleozoic rock to the strike of the Karatau fault attest to right-lateral slip on this fault (Burtman, 1964). \r\n','Burtman et al. (1996); Burtman (1964); Afanas\'yeva et al. (1983)\r\n','2015-07-15 14:18:00'),(19,'Gardiz Fault','Also spelled Gardez. See Chaman Fault.\r\n','Afghanistan',NULL,NULL,NULL,'','5.4','Mohadjer et al. (2010) use the differences in velocities of GPS sites at Quetta (Pakistan) and Kabul (Afghanistan) to estimate an upper bound of 5.4 +/- 2 mm/yr of sinistral shear across the combined Gardiz and Mokur faults. They also use the difference between the Kabul and Peshawar (Pakistan) velocities to estimate 18.1 +/- 1 mm/yr of total sinistral shear on the gardiz-Mokur-Konar system. Szeliga et al. (2012) decomposed the baseline velocity between the same GPS stations and observed a total of 16.8 mm/yr of sinistral motion and 9.2 mm/yr of convergence for the Gardez fault near Kabul.\r\n',NULL,NULL,NULL,NULL,NULL,'The southern section of the Gardiz fault is marked by a 7-8 km-wide zone of northeast-trending linear, discontinuous scarps on piedmont alluvium (Ruleman et al., 2007). The northern part of the fault consists of a complex zone of conjugate and Riedel shear zones in a dominantly left-lateral, strike-slip fault zone. In this region, the fault zone has northeast and northwest trending, continuous, linear scarps on piedmont and river valley alluvium. Ruleman et al. (2007) found evidence of right-lateral and left-lateral offsets on Quaternary deposits.  At its northern end, the Gardiz fault terminates in a complex junction with the Sorubi fault and the western part of the Safed Koh-Main Boundary thrust system.\r\n',NULL,NULL,NULL,'Left-lateral strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Szeliga et al. (2012); Mohadjer et al. (2010); Ruleman et al. (2007)\r\n','2015-07-15 14:18:00'),(20,'Andarab Fault','Also known as Andarabad or Andarob Fault.','Afghanistan','North Afghan Platform ',NULL,'The fault could be concealed beneath a major river course along its central section where intra-valley fault scarps are less continuous than to the east (Ruleman et al., 2007).\r\n\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'','The Bamiyan earthquake of 1956 (M 7.4) appears appears to have occurred in the region bounded by the Herat fault and the Andarabad fault, but the causal fault the slipped in this earthquake is not known (Ambraseys and Bilham, 2009). Geologic evidence, however, suggests that the Andarab fault is currently active (Ambraseys and Bilham, 2009). ','Tapponnier and others (1976) observed sub-linear, continuous scarps on middle to late Pleistocene alluvium and on bedrock surfaces in the eastern section of the Andarab fault in the high valley of Darya ye Wulma. Shutter ridges and deflected streams indicate a right-lateral sense of displacement. Wellman (1965) describes ridges that show dextral displacement of 25 m. Geological evidence suggests that the Andarabad fault 80 km north of Bamiyan is currently active (Ambraseys and Bilham, 2009). ',NULL,NULL,NULL,'Dextral (right lateral), Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ruleman et al. (2007); Tapponnier et al. (1976); Wellman (1965); Ambraseys and Bilham (2009)','2015-07-15 14:18:00'),(21,'Qarghanaw Fault System',NULL,'Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Sinistral (left lateral)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ruleman et al. (2007)','2015-07-20 14:27:32'),(22,'Dezghat-Bannh Fault System',NULL,'Pakistan',NULL,NULL,NULL,NULL,NULL,'The uniform convergence observed west of Quetta suggests that shortening in the Kirthar Range is focused along structures east of Quetta, such as the Dezghat-Bannh\r\nFault System (Szeliga et al., 2012)',NULL,NULL,NULL,NULL,'1931 Mach Earthquake (Szeliga et al., 2009)',NULL,NULL,NULL,NULL,'Thrust',NULL,'W',NULL,NULL,NULL,NULL,NULL,NULL,'Szeliga et al. (2009, 2012);','2015-08-02 14:41:43'),(23,'Kunar Fault; Konar Fault','Konar Fault; the Sorubi-Konar fault system; ','Afghanistan',NULL,'Exposed','Clear on Landsat imagery, the Kunar fault seems to terminate in the west near the Sarubi fault, an active right-lateral strike-slip fault (Prevot et al., 1980; Wellman, 1966). ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ruleman et al. (2007) mapped sinistral offsets in young deposits of active alluvial fans, indicative of recent surface faulting. ','At its northern end, the Gardiz fault (pl. 1) terminates in a complex junction with the Sorubi fault (no. 57, Plate 1) and the western part of the Safed Koh-Main Boundary thrust system (pl. 1, no. 74). Northeast of this junction, \r\n\r\nRuleman et al. (2007) mapped and reported evidence of active left-lateral faulting; continuous fault scarps on piedmont landforms and on Quaternary deposits of various ages along the Konar fault northeast of the Gardiz-Sorubi faults junction.',NULL,NULL,NULL,'Sinistral (left-lateral); Strike-slip; Thrust','This fault is shown as a thrust by Chatelain et al. (1980).\r\n\r\nNortheast of the Gardiz-Sorubi faults junction, Ruleman et al. (2007) reported evidence of active left-lateral faulting.\r\n\r\nNortheastward along the Konar fault, the range-front morphology, shutter ridges, and southeast-facing fault scarps all indicate a progressively greater component of thrust faulting (Ruleman et al., 2007). The sense of slip further to the northeast where the Konar fault merges into a north-northeast-trending fault zone, also appears to be primarily thrust faulting. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Prevot et al. (1980); Wellman (1966); Ruleman et al. (2007);','2015-07-15 14:18:00'),(24,'Kunlun Fault','','China','Tibet; Qaidam Basin; Northern Tibet','Exposed','This fault is visible on satellite imagery and in the field (Kidd and Molnar, 1988; Tapponnier and Molnar, 1977). The fault cannot be traced clearly west of ~90°E (Molnar et al., 2010)','6','10','GPS measurements (Hilley et al. 2005; Zhang et al., 2004) show a rate of ~10 mm/yr for the segment just south of\r\nthe Qaidam Basin.\r\n\r\nChen et al. (2000) reported 6 ± 2 mm/yr of left-lateral shear for the eastern Kunlun fault, with no significant shortening.  \r\n\r\nGPS measurements near the eastern end also show that localized slip on the Kunlun fault disappears where the fault trace\r\ndisappears (Kirby et al., 2007).',NULL,'2','11.5','Late Pleistocene-Holocene left-slip rate  of 11.5 ± 1.5 was deduced from cosmogenic 10Be-26Al and 14C dating of alluvial strath terraces at six sites along the Kunlun fault. This rate is an average slip rate (thirteen independent, time-integrated slip rates were obtained) along 600 km of fault (Tapponnier et al., 2001). Offsets ranged from 24 m to 400 m. \r\n\r\nEarly analysis suggested a rate of ~10 mm/yr (e.g., Kidd and Molnar, 1988) and subsequent detailed examination of late Quaternary faulting (e.g., Van der\r\nWoerd et al., 1998, 2000, 2002) have confirmed this rate. \r\n\r\nVan der Woerd et al. (2002) presented evidence for slip along the fault at\r\nfive sites south of the Qaidam Basin.\r\nThey estimated upper bounds on rates of ~11 ± 2 mm/yr and lower bounds on rates of 7–9 mm/yr over late Pleistocene to Holocene time. \r\n\r\nHaibing et al. (2005) estimated\r\nthe rate near the west end of the\r\ntrace, ~300 km southwest of the Qaidam Basin. They gave an upper bound on the rate of 10.7 ± 3.5 mm/yr over mid-Holocene. Using their age for the terrace above the offset riser, however, gives a lower bound of only 5.2 ± 1.7 mm/yr. Thus, the rate might decrease toward the west end of the trace, where it diverges from the Qaidam Basin (Molnar et al., 2010).\r\n\r\nKirby et al. (2007) and Harkins and Kirby (2008) showed that the rate decreases markedly toward the eastern end of the fault, dropping from ~10 mm/yr to nil over a distance of ~200 km, in the segment that is south and east\r\nof the eastern end of the Qaidam Basin.\r\n','A series of large earthquakes in the past century have been attributed to the central and western segments of the fault including the 2001 Kokoxilli event of Ms 8.1 (Lin et al., 2002; Van der Woerd et al., 2002a).  \r\n\r\nAlmost the entire length of the fault west of 100 degree E has experienced a historic rupture. This includes the 1997 Manyi earthquake of Mw 7.6 (Peltzer et al., 1999) and the 1937 Dongxi Co earthquake of M 7.5 and two smaller events (cf. Van der Woerd et al., 2002b).\r\n\r\nThe eastern segments of the fault, however, appear to have experienced little historic seismicity (Gu et al., 1989; Van der Woerd et al., 2002b). ','',NULL,'Recent paleoseismic investigations\r\nnear the town of Maqu reveal that\r\nthe most recent rupture along eastern segments of the Kunlun fault appears to have occurred between 1700 and 3700 ka\r\n(He et al., 2007).',NULL,'Strike-slip; Sinistral (left lateral)',NULL,NULL,NULL,'1200','1500 km (Kirby et al., 2007); 1000 km (Taylor and Yin, 2009)',NULL,NULL,NULL,'Hilley et al. (2005); Zhang et al. (2004); Kidd and Molnar (1988); Tapponnier and Molnar (1977); Kirby et al. (2007); Tapponnier et al. (2001); Van der Woerd et al. (2002); Li Haibing et al. (2005); Harkins and Kirby (2008); Chen et al. (2000); ','2015-07-16 12:33:55'),(25,'The Kashgar-Yecheng Transfer System','The fault system is described by Cowgill (2010) and includes Aertashi, Yarkand, Kumtag, and Kusilaf faults. The Kusilaf fault was previously named the Main Pamir Thrust by Sobel (1999) and Sobel and Dumitru (1997).','China','Pamir, Yarkand River, ',NULL,NULL,NULL,NULL,NULL,NULL,'7','15','Transpressional right slip along faults in this transfer system appears to have accommodated late Cenozoic separation of the North Pamir from the Western Kunlun Shan during south-directed intracontinental subduction beneath the leading edge of the Pamir salient. Correlation of major faults suggest total slip along the Kashgar-Yecheng transfer system is likely on the order of ~280 km. This offset implies long-term slip rates of 7-15 mm/a along the transfer system when combined with previous data that indicate deformation between the late Eocene and early Miocene (Cowgill, 2010).',NULL,NULL,NULL,NULL,'Previous work along the Kashgar-Yecheng\r\nsystem has emphasized paleomagnetic and sedimentologic aspects of the Cretaceous and Tertiary deposits (Chen et al., 1992; Rumelhart et al., 1999; Yin et al.,\r\n2002). ','Dextral (right lateral); Strike-slip','Several observations suggest that the system is transpressional (Cowgill, 2010).',NULL,NULL,'350 ','Cowgill (2010)',NULL,NULL,NULL,'Cowgill (2010)','2015-07-15 14:18:00'),(26,'Altyn Tagh Fault','Altyn Tagh Fault System; Karakax Fault;','China','Tarim Basin; Tibet; Northern Tibet',NULL,NULL,'9','10','GPS measurements show rates of about\r\n~10 mm/yr in the central segment: 9 ± 5 mm/yr (Bendick et al., 2000), 9 ± 2 mm/yr (Chen et al., 2000); and 9 ± 4 mm/yr (Wallace et al., 2004). ','11 ± 5 mm/yr (Elliott et al., 2008)','9','26.9','Mériaux et al. (2004) reported an upper bound on the rate of 26.9 ± 6.9 mm/yr based on offset features observed at two sites. For several other sites along the central part of the fault, Mériaux et al. (2005) and Xiwei et al. (2005) suggested upper bounds on rates >20 mm/yr. Cowgill (2007), however, estimated a rate of 9.4 ± 2.3 mm/yr for one of the sites previously studied but  inferred a rate between 9.0 ± 1.3 and 15.5 ± 1.7 mm/yr for one site near that studied by Cowgill (2007) and between 9 and 14 mm/yr for another.\r\n\r\nRates reported by Mériaux et al. (2004, 2005) and Xu et al. (2005) were assessed by Zhang et al. (2007) and consistent with 10 mm/yr along the central segment of the fault with the rate diminishing to zero at the eastern end of the fault, also suggested by (Chen et al., 2000; Meyer et al., 1996).\r\n\r\nWashburn et al. (2001a, 2001b) inferred a rate of 10–20 mm/yr from estimates of repeat times of earthquakes and amounts of slip. \r\n\r\nMolnar et al. (2010) concluded that a rate of 10 ± 2 mm/yr in the central\r\nsegment of the Altyn Tagh fault is consistent with all data.','Washburn et al. (2003) reported evidence for the last two earthquakes, the most recent occurred between 1456 and 1775 cal. A.D. and the penultimate event was between 60 and 980 cal. A.D. ','Late Quaternary offsets','The Camel paleoseismic site along the Xorxol segment (easternmost) of the central Altyn fault reveals a well-preserved record of repeated ground rupture, yielding robust timing constraints for 2-3 earthquakes inthe last 2-3 kyr (Washburn et al., 2003). ','Paleoseismic data as interpreted by Washburn et al. (2003) indicate multiple earthquakes with short rupture lengths (~50 km) along the Xorxol segment of the fault. ',NULL,'Strike-slip; Sinistral (left lateral)','The Altyn Tagh fault has the character of a left-lateral, transpressive transfer fault as proposed by Burchfiel et al. \r\n(1989) and Tapponnier et al. (1990).',NULL,NULL,'2000',NULL,NULL,NULL,NULL,'Bendick et al. (2000); Shen et al. (2000); Wallace et al. (2004); Elliott et al. (2008); Mériaux et al. (2004, 2005); Cowgill (2007); Gold et al. (2009); Cowgill et al. (2009); Molnar et al. (2010); Washburn et al. (2001a, 2001b); Chen et al. (2000); Meyer et al. (1996); Xu et al. (2005); Zhang et al. (2007); Burchfiel et al. (1989); Tapponnier et al. (1990)','2015-08-02 10:47:35'),(27,'Paghman Fault','The northern section of the Chaman fault system corresponds to the Paghman fault (Ruleman et al., 2007). See also Chaman-Paghman fault system.','Afghanistan','Northern Afghan Platform ',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'The 1505 (M 7.3) earthquake was associated with at least 40 km long surface rupture of the Paghman fault, 20 km north-west of Kabul, which strikes N20°E (Ambraseys and Bilham, 2009). The earthquake caused vertical offsets of 3 m on this fault and possibly some strike-slip faulting of unknown amount. \r\n\r\nThe 1874 (M 7.0) earthquake occurred near the north terminus of the Paghman fault (Ambraseys and Bilham, 2009).','Ruleman et al. (2007) measured the left-lateral displacement of active streams and river channels, and noted deposits from old alluvial fans that have been left-laterally transported considerable distances (≥ 155 m) from their original sources. Their observations indicate recent movement of the Paghman fault throughout much of Quaternary time.',NULL,NULL,NULL,'Sinistral (left lateral)','Ruleman et al. (2007)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ambraseys and Bilham (2009); Ruleman et al. (2007);','2015-07-15 14:18:00'),(28,'Balapora Fault',NULL,'Pakistan','Kashmir; Northwestern Himalaya',NULL,NULL,NULL,NULL,NULL,NULL,'0.3','1.3','0.8 ± 0.5 (Schiffman et al., 2013) and 0.3-1.3 mm/yr based on paeloseismic investigations.','The date of the most recent slip on the Balapora fault is probably >1 kyr (Meigs et al., 2012)','Deformed terraces along the Rambira River exhibit ~13 meters of vertical separation across the Balapora fault (Meigs et al., 2012). ',NULL,'Paleoseismic investigations reveal a preliminary shortening rate of 0.3-1.3 mm/yr (Meigs et al., 2012; Schiffman et al., 2013)',NULL,'Reverse','Vignon (2011) interpreted the Balapora fault as a wedge thrust overlying a\r\nsoutheast dipping antithetic fault (Schiffman et al., 2013).','~60°NE','Meigs et al. (2012)','40 km',NULL,NULL,NULL,NULL,'Schiffman et al. (2013); Vignon (2011); Meigs et al. (2012)','2015-07-15 14:18:00'),(29,'Red River Fault',NULL,'China, Vietnam','Eastern Tibet',NULL,NULL,'1','5','1.6 ± 0.5 mm/yr Simons et al. (2007); 1–5 mm/yr Duong and Feigl (1998) but with low confidence in the southeast part of the fault in Vietnam; 2 ± 2 mm/yr of slip for the northwest segment and 1 ± 2 mm/yr for the central segment (Shen et al. (2005). ',NULL,'1.6','5','Based on offsets of 2-3 Ma, Allen et al. (1984) deduced a rate of 2–3 mm/yr, but allowed for a slip rate as fast as 5 mm/yr. Based on stream offsets, Replumaz et al. (2001) gave an average slip rate of 5 mm/yr. A detailed trenching at one site by Weldon et al. (1994) led them to infer a rate of 1.6 ± 0.5 mm/yr. Molnar et al. (2010) conclude that all investigations call for a maximum of 10 mm/yr and most suggest as few as 1–3 mm/yr for the Red River Fault.',NULL,NULL,'Weldon et al. (1994) inferred a geologic slip rate of 1.6 ± 0.5 mm/yr from a detailed trenching at a site.\r\n',NULL,NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Styron et al. (2010); Taylor et al. (2009); Wang et al. (1998); Leloup et al. (1995)','2015-07-15 14:18:00'),(30,'The Aksu-Murgab Fault System',NULL,'Tajikistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,'According to Burtman and Molnar (1993 and references within), strike-slip displacements of up to 60 km can be reliably determined. Observations of satellite images by Robinson et al. (2009), however, did not show any significant displacements across this fault zone.    ',NULL,NULL,NULL,'Dextral (right lateral); Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Aksu-Murgab fault system is described by Burtman and Molnar (1993) as a system of northwest-trending right-lateral\r\nstrike-slip faults that cuts the thrust\r\nsheets within the Southeastern Pamir nappe. It constitutes splays of the norhtwest-trending Pamir-Karakorum fault (Burtman and Molnar, 1993) and the Achiehkopai fault (Robinson, 2009).','Burtman and Molnar (1993); Ruzhentsev, (1963, 1968); Robinson (2009); ','2015-07-15 14:18:00'),(31,'Badakhshan Fault','Badakhshan Fault Zone (Schurr et al., 2014); Central Badakhshan Fault (Ruleman et al., 2007) ','Afghanistan, Tajikistan','Badakhshan; North Afghan Platform',NULL,'The fault zone can be traced from central Badakhshan, Afghanistan, across the Panj River to the northern margin of the Yazgulem dome (Schurr et al., 2014).',NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,'Offset morphologic features and\r\nobservation within the fault core in central Badakhshan of Afghanistan, indicate dextral slip motion for this fault (schurr et al., 2014).',NULL,NULL,NULL,'Strike-slip; Dextral (right lateral)','Mapped as dextral by Schurr et al. (2014) and as strike-slip and thrust by Ruleman et al. (2007). Fault zones in central Badakhshan of Afghanistan may actually be composite structures that are comprised of segments of northwest- and north-northeast-trending, strike slip faults and segments of southeast-verging thrust faults (Ruleman et al. (2007).\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'','Schurr et al. (2014); Ruleman et al. (2007)','2015-08-02 10:54:10'),(32,'Karakax Fault','The westernmost segment of the Altyn Fault is named Karakax Fault. Also spelled as Karakash fault.    ','China','Tibet, Tarim Basin',NULL,NULL,'5','7','7 ± 3 mm/yr from GPS measurements (Shen et al., 2001b)','5 ± 5 mm/yr (Wright et al., 2004)','','20','Extrusion models (Shen et al., 2001a; Peltzer et al., 1989) suggest a 20 mm/yr of slip. England et al. (1997), however, conclude that this rate is based on correlations of ages of offset landforms with changes in global climate and not on radiometric dating, and hence, is an overestimation. \r\n',NULL,NULL,NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)',NULL,NULL,NULL,NULL,NULL,'N100E',NULL,NULL,'Shen et al. (2001); Peltzer et al. (1989); Wright et al. (2004); England et al. (1997)','2015-07-16 16:02:02'),(33,'Gissar-Kokshal Fault Zone','Gissar-Kokshal Fault Zone; Iliac Fault','Tajikistan, Uzbekistan','Tajik Depression; Southern Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Sinistral (left lateral); Thrust','Shown as left-lateral in Schurr et al. (2014)',NULL,NULL,NULL,NULL,NULL,NULL,'Illiac fault is the southern spur of the Gissar-Kokshal system. Leith (1985) noted a marked discontinuity in thickness of post-Jurassic sediments across this fault and attributed it to deposition on faulted blocks along a passive margin. Hamburger et al. (1992), however, attribute this discontinuity to the tectonic juxtaposition of sediments initially deposited in areas 60 km apart. ','Schurr et al. (2014); Leith et al. (1981); Bourgeois et al. (1997); Leith (1985); Hamburger et al. (1992); ','2015-07-15 14:18:00'),(34,'Sarez-Karakul Fault System',NULL,'Tajikistan','Pamir, Sarez, Gorno-Badakhshan Autonomous',NULL,'Best exposed between the lakes of Sarez and Karakul (Schurr et al., 2014)',NULL,NULL,NULL,NULL,'',NULL,NULL,'Ambraseys and Bilham (2012) located the epicenter for the M 7.7 1911 Sarez earthquake somewhere at the western end of Lake Sarez. Schurr et al. (2014) attributed this earthquake to two potential fault zones: (1) the Sarez-Karakul fault system which is the only seismically active structure of appropriate dimension near the epicenter; or (2) the Sarez-Murghab thrust system and its eastward connection into the Aksu-Murghab fault zone. Based on InSAR and seismological data, Sangha et al. (2017) concluded that the Mw 7.2, 2015 Murghab earthquake ruptured and reactivated several segments of the Sarez-Karakul fault.   ','Schurr et al. (2004) recorded morphologic expression of the sinistral-oblique normal faulting along the southern Sarez-Karakul fault system. ',NULL,NULL,NULL,'Sinistral (left lateral), Normal',NULL,NULL,NULL,NULL,NULL,'NE',NULL,NULL,'Schurr et al. (2014); Ambraseys and Bilham (2012); Sangha et al. (2017)','2018-04-30 12:34:21'),(35,'Sarez-Murghab Thrust System',NULL,'Tajikistan, Afghanistan, China ','Pamir',NULL,NULL,NULL,NULL,NULL,NULL,'','','Robinson (2009) reports a long-term rate of 6.89 ± 0.8 and 10.8 ± 1.3 mm/yr using two different initiation ages (23 ± 1 Ma and 14.7 ± 1 Ma, respectively). The measurement location cover the northern extension of the Karakorum fault from the southwest Pamir to the Tianshuihai terrane of western Tibet.  ',NULL,NULL,NULL,NULL,NULL,'Dextral (right lateral), Thrust','Dextral-oblique thrust (Schurr et al., 2014)',NULL,NULL,NULL,NULL,NULL,NULL,'This thrust system separates the Central and South Pamir, reactivating the Rushan-Pshart suture zone (Schurr et al., 2014). It is traced by unconsolidated fault gouges and cataclasites and scarps and interacts with the Aksu-Murghab fault zone of the southeaster Pamir (Strecker et al., 1995).','Schurr et al. (2014); Strecker et al. (1995)','2016-10-06 10:57:06'),(36,'Tanymas Thrust System ',NULL,'Tajikistan, China, Afghanistan','Pamir',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr et al. (2014)','2015-07-15 14:18:00'),(37,'North Aksay Fault',NULL,'Kyrgyzstan','Aksay Basin',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,'Large moraines, formed during the last glacial period are offset <1 m by the North Aksay fault; inset, younger moraines do not appear displaced.',NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thompson et al. (2002);','2015-07-15 14:18:00'),(38,'Akchatash Fault',NULL,'Kyrgyzstan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'This fault and associated folds separate the northern margin of Naryn basin from the Moldo-Too Range (Makarov, 1977). According to Thompson et al. (2002), late Quaternary terraces that cross the boundary between basin and range do not seem to be deformed. Their observations include several locations where this fault cuts a Plio-Pleistocene conglomerate unit, but in others, anticlinal folding of the preorogenic erosion surface an unconformable contact between pre-Cenozoic basement and Cenozoic strata mark the basin boundary. The anticlinal folding at the basin margin seems to indicate the transfer of fault slip from a north dipping crustal ramp underlying the Moldo-Too to the gently north dipping Kadjerty and Central Naryn faults that penetrate the northern Naryn Basin (Thompson et al., 2002).','Thompson et al. (2002);','2015-08-02 10:34:27'),(39,'Shamsi-Tunduk Fault','The eastward continuation of the Chonkurchak fault. Also see Chonkurchak fault. ','Kyrgyzstan','Chu Basin',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Late Pleistocene terraces near the Almedin River are folded along portions of the Shamsi-Tunduk fault, although the amplitude of folding indicates minor late Quaternary surface shortening compared with the folded and faulted terraces above the Issyk-Ata fault. Thompson et al. (2002) interpret the Issyk-Ata fault as a splay from the Shamsi-Tunduk/Chonkurchak fault beneath the southern margin of the Chu Basin.','Thompson et al. (2002)','2015-07-15 14:18:00'),(40,'Chonkurchak Fault','See Issyk-Ata fault and Shamsi-Tunduk fault.','Kyrgyzstan','Chu Basin',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Issyk-Ata fault merges at its western terminus with the Chonkurchak fault, which marks the boundary between pre-Cenozic basement at the Kyrgyz Range front and late Cenozoic deposits in the western Chu Basin. Farther east, between the Ala-Archa and Alamedin Rivers, the Chonkurchak fault steps north and its eastward continuation is called the Shamsi-Tunduk fault. ','Thompson et al. (2002)','2015-07-15 14:18:00'),(41,'Reshun-Hunza Fault System',NULL,'Afghanistan; Pakistan','',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust, Sinistral (Left-lateral)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr et al. (2014)','2015-07-15 14:18:00'),(42,'Illiac Fault',NULL,'Tajikistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip; Dextral (right lateral)','Schurr et al. (2014)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr et al. (2014)','2015-07-15 14:18:00'),(43,'Himalayan Main Frontal Thrust','Named also Himalayan Frontal Thrust in Molnar and Tapponnier (1975). See Black Mango fault which is located along the northwestern portion of the Himalayan Frontal Thrust. Also see Mohand Thrust which is a segment of the Himalayan Frontal Thrust.  ','India, Nepal, Bhutan, Pakistan','Himalaya','Mostly concealed ','According to Raiverman et al. (1993), the Himalayan Frontal Thrust is concealed by Quaternary deposits or eroded within their map area. Wesnousky et al. (1999) supports this observation but also point out to a short segment of the range front near Chapri rao and west of the Tamuna River which displays a morphology indicative of surface faulting in late Pleistocene or younger deposits.     ','10','20','Based on GPS measurements, the total convergence between the Indian and Eurasian plates is estimated to be between 40-50 mm/yr. Of this total convergence, 10-20 mm/yr is accommodated by thrust motion along the Himalayan arc. The major thrust faults in the Himalayan arc are: the Main Central Thrust, the Main Boundary Thrust and the Himalayan Frontal Thrust, the latter two are considered to be active. Model inversions of the GPS data of Banerjee and Buergmann (2002) indicate the Main Front Thrust about 100 km north of the Siwalik Foothills is building up a slip deficit at a rate of 14 ± 1 mm/yr.   ',NULL,'11.9','21','For the Black Mango Fault, Kumar et al. (2001) estimated the rates of fault slip and crustal shortening to be 9.6 (+7.0 -3.5) mm/yr and 8.4 (+7.3 -3.6) mm/yr, respectively.  \r\n\r\nFrom balanced cross sections and Quaternary dating methods, Lave and Avouac (2000) determined that the Main Frontal thrust is moving at 21 ± 5 mm/a and ultimately feeds slip into the Main Himalayan thrust at depth.\r\n\r\nBased on their interpretation of fluvial terrace deposits, Wesnousky et al. (1999) estimated the rates of horizontal shortening and slip for the Himalayan Frontal Thrust to be >11.9 ± 3.1 mm/yr and >13.8 ± 3.6 mm/yr respectively. ','The 2015 Gorkha earthquake of Mw 7.8 ruptured a subhorizontal portion of the Main Himalayan Thrust (Galetzka et al., 2015; Avouac et al., 2015). \r\n\r\nModern-day seismicity along the Himalayan Frontal Thrust is concentrated at depths between 10 and 20 km below the Main Central Thrust. GPS data indicate strain accumulation above the Main Central Thrust and nearly none to the south between the Main Central Thrust and the Himalayan Frontal Thrust. \r\n\r\nBased on these observations, Kumar et al. (2001) concluded that major historic earthquakes initiated at a point of localized strain accumulation beneath the Main Central Thrust and propagated southward on the order of 100 km along a shallow decollement that surfaces as the Himalayan Frontal Thrust.\r\n\r\nThe 1905 Kangra earthquake is assumed to be the result of thrust motion on the Himalayan Frontal Thrust based on the isoseismal distribution (Wesnousky et al., 1999). ','Active deformation along the Himalayan Frontal Thrust includes scarps, uplift and folding of late Quaternary and Holocene deposits. None of the major historical earthquakes have reportedly produced surface rupture along the Himalayan Frontal Thrust (Kumar et al., 2001). ','Kumar et al. (2001) excavated a trench across a scarp of the Black Mango fault, showing that the scarp is the result of slip and folding associated with four low-angle thrusts. See paper for description of each fault strand. ',NULL,NULL,'Thrust',NULL,'30° ± 10°','Based on Observations made from a borehole, a well, and seismic reflection lines, Wesnousky et al. (1999) concluded that the Himalayan Frontal Thrust dips northerly at about 30 degrees and extends to or very close to the surface at the foot of the Siwalik Hills. \r\n\r\nIn their slip rate estimation for the Black Mango Fault, Kumar et al. (2001) also assumed that the Himalayan Frontal Thrust dips 30° ± 10°. ',NULL,NULL,NULL,NULL,'The Himalayan Thrust is considered to be the most active of the three major south-verging thrust faults that strike the 2500 km length of the Himalayan arc. It displaces Tertiary and Quaternary sediments of the Siwalik Group over the Indi-Gangetic plain (Kumar et al., 2001). ','Lave and Avouac (2000); Taylor and Yin (2009); Molnar and Tapponnier (1975); Kumar et al. (2001); Banerjee and Bürgmann (2002); ','2015-08-11 16:23:06'),(44,'South Tien Shan Thrust','This fault is known by other names including the Aheqi Fault, the Kipchakskiy Fault and the Beibugugu Fault.','China','Tien Shan; Tarim Basin',NULL,'This fault is traceable on Landsat images. The fault trace named South Tien Shan Thrust in Taylor et al. (2009) is shown much further south from the mapped location of the fault by Allen et al. (1999). Thompson et al. (2002) show an anticline very close to the fault location of Taylor and Yin (2009).',NULL,NULL,NULL,NULL,'',NULL,NULL,'The South Tien Shan Fault is seismically active, producing earthquakes with focal depths at mid-crustal levels (14 and 18 km).',NULL,NULL,NULL,NULL,'Thrust','The South Tien Shan Fault has been interpreted as a sinistral fault (Dong Jia et al., 1998), a major Cenozoic north dipping thrust (Tang et al., 1991; Biske, 1995), and predominantly a thrust fault (Allen et al., 1999). \r\n\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'The South Tien Shan Fault is a north dipping thrust that forms the northern boundary of the Kepingtage thrust zone, separating it from the southern Tien Shan. The fault may represent a Cenozoic reactivation of a late Paleozoic structure, and presently a boundary between the underthrust Tarim Block and the southern Tien Shan (Allen et al., 1999). \r\n','Thompson, et al. (2002); Tapponnier and Molnar (1979); Allen et al. (1999); Taylor and Yin (2009); Biske (1995); Tang et al. (1991); Dong et al. (1998)','2015-07-15 14:18:00'),(45,'Dauki Thrust',NULL,'India; Bangladesh','Shillong Plateau; Eastern Himalaya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Clark and Bilham (2008)','2015-07-17 09:44:39'),(46,'Kongur Shan Fault','Named Muztaghata graben in Tapponnier and Molnar (1979).','China','Pamir',NULL,NULL,'5.1',NULL,'The GPS slip rate of 5.1 ± 0.8 is cited in Schoenbohm et al. (2011) and is from the work of Yang et al. (2008) and Zubovich et al. (2010). The measurement location remains unknown. \r\n',NULL,'','6.5','According to Robinson et al. (2010), using previous geochronologic and thermobarometric studies, cooling ages along Kongur Shan massif in the eastern Pamir can be modeled as the result\r\nof a constant slip rate on the Kongur Shan normal fault of 6.5 mm/yr since ~7 Ma if erosion of footwall material is taken into account. Assuming a 40 degree west-dipping fault, Schoenbohm et al. (2011) report a vertical displacement rate of 4.2 mm/yr and an E-W extension rate of 5.0 mm/yr. ','M 7.5 1895 Tashkorgan earthquake (Chevalier et al., 2011b).',NULL,NULL,NULL,NULL,'Normal','Mapped as a detachment fault in Cowgill (2010), and as normal in Brunel et al. (1994) and Schurr et al. (2014).','~40 degrees','Robinson et al. (2004)',NULL,NULL,NULL,NULL,'The Kongur fault is an active extensional system that has developed near the northern terminus of the Karakorum fault (Brunel et al., 1994). It has accommodated more than 35 km of east-west extension since about 7 Ma. The ongoing local extension is captured in the GPS velocity field between the interior of the Pamir and Tarim block and might be attributed to the clockwise rotation of a rigid Tarim block (Schurr et al., 2014).  \r\n','Taylor et al. (2009); Cowgill (2010); Brunel et al. (1994); Tapponnier and Molnar (1979); Schurr et al. (2014); Robinson et al. (2010); Schoenbohm et al. (2011)','2016-10-06 09:38:05'),(47,'Longmu-Gozha Co Fault','Southern splay of Altyn Tagh Fault.','China, India',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'Close to the March 20 2008 Mw 7.1 earthquake (Taylor et al., 2009). The event was dominantly dip-slip with a minor left-slip component consistent with the active northeast-striking faults occurring in releasing stepovers along the Longmu-Gozha Co fault system (Shap and Chen, 2008).','Holocene left-lateral movement confirmed in field by Liu et al. (1991)',NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral) ','A left-lateral splay of the Altyn Tagh',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Avouac et al. (1993); Taylor et al. (2009);','2015-07-15 14:18:00'),(48,'Qilian Shan-Nan Shan Thrust Belt',NULL,'China','Qaidam basin, Tibet',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'See Yin et al. (2008) for a geologic map of the Qilian Shan-Nan Shan thrust belt as well as the locations of their observations, geologic cross sections and seismic reflection profiles. ','Yin et al. (2008)','2015-07-15 14:18:00'),(49,'Western Kunlun Thrust Belt ','Also referred to as Western Kunlun Shan Thrust Belt. ','China','Tarim Basin',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust','Mapped as syncline and anticline by Styron et al. (2010) and Taylor et al. (2009). ',NULL,NULL,NULL,NULL,NULL,NULL,'The Altyn-Tagh fault is kinematically connected with several fault system including the Western Kunlun Thrust Belt.','Styron et al. (2010); Taylor et al. (2009); Avouac and Peltzer (1993);','2015-07-15 14:18:00'),(50,'Dalong Fault',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gold et al. (2006)','2015-07-15 14:18:00'),(51,'Main Mantle Thrust','Named Indus-Tsangpo suture zone in Burtman and Molnar (1993), and Indus-Yalu suture in Robinson (2009). ','India, Pakistan, Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Indus-Tsang-po suture zone is a belt of ophiolites that follows the Tsang-po and Indus valley in southern Tibet, wraps around the northwestern margin of the Indian subcontinent and seems to continue into southern Pakistan, Afghanistan, and Iran (Burtman and Molnar, 1993). \r\n\r\nThe Indus-Tsang-po as well as the Shyok ophiolite belts seem to mark the suture between the Indian subcontinent and southern Eurasia. The Indus-Tsang-po\r\nsuture zone probably resembles the pre-collisional shape of India\'s margin more than that of southern Eurasia. \r\n','Schurr et al. (2014); Cowgill (2010); Burtman and Molnar (1993); Robinson (2009)','2015-07-15 14:18:00'),(52,'Black Mango Fault','Also see Himalayan Frontal Thrust','India',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','8.4','For the Black Mango Fault, Kumar et al. (2001) estimated the rates of fault slip and crustal shortening to be 9.6 (+7.0 -3.5) mm/yr and 8.4 (+7.3 -3.6) mm/yr, respectively. ','The fault displays evidence for two large surface rupture earthquakes during the past 650 years, subsequent to 1294 A.D. and 1423 A.D and possibly another rupture at about 260 A.D. (Kumar et al. 2001)','The fault truncate fluvial strath terraces of the Markansa River, reflecting long term uplift along the Himalayan Frontal Thrust (Kumar et al., 2001)','Kumar et al. (2001) excavated a trench across a scarp of the Black Mango Fault to place bounds on the size and recurrence time of the most recent of the earthquakes that have produced uplift of the Markanda terraces. See their paper for more details.',NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Black Mango fault is a structural discontinuity that transforms motion\r\nbetween two segments of the active Himalayan Frontal Thrust. ','Kumar et al. (2001)','2015-07-15 14:18:00'),(53,'Siahan Fault','The southern end of the Chaman Fault.','Pakistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Lawrence et al. (1992)','2015-07-15 14:18:00'),(54,'Panjgur Fault',NULL,'Pakistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Panjgur fault solays from the southern tip of the Chaman fault where the component of thrust displacement increases to the west (Lawrence et al., 1992)',NULL,'2015-07-15 14:18:00'),(55,'Nai Rud Faults',NULL,'Pakistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-15 14:18:00'),(56,'Hoshab Fault',NULL,'Pakistan','Makran; Balochistan',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'The September 2013 Mw 7.7 Balochistan strike-slip earthquake (also known as Awaran) ruptured a 200+ km section of the curved reverse Hoshab fault in southern Pakistan (Barnhart et al., 2014).','Geomorphic features such as offset drainage and geology at different locations along the fault (associated with the 2013 Balochistan earthquake) are visible on Landsat-8 satellite image (Zinke et al., 2013). ',NULL,NULL,NULL,'Strike-slip; Sinistral (left-lateral)','Based on offset of a river drainage, Zinke et al. (2013) suggest that the Hoshab Fault has accommodated left-lateral strike-slip displacement in addition to possible early thrust displacements. ','45-75 degrees',NULL,'>200 km',NULL,NULL,NULL,'The Hoshab Fault is considered to be part of a mechanical transition zone between N-S convergence in the Makran convergence zone to the west and N-S left-lateral strike-slip on the Chaman Fault to the north and east (Lawrence et al., 1981; Zinke et al., 2013).','Barnhart et al. (2014); Lawrence et al. (1981); Zinke et al. (2013);','2015-07-15 14:18:00'),(57,'Henjvan Fault',NULL,'Afghanistan','Badakhshan; Hindu Kush; North Afghan Platform',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Mapping by Ruleman et al. (2007) suggests that this fault zone may actually be composite structures that are comprised of segments of northwest- and north-northwest-trending, strike slip faults and segments of southeast-verging thrust faults. They conclude that additional studies using higher resolution imagery and filed investigation are needed to more accurately characterize this fault. ','Ruleman et al. (2007)','2015-07-15 14:18:00'),(58,'Sarobi Fault','Sarubi; Safed Koh','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'According to Wheeler et al. (2005), an array of portable seismographs on and near the Sarobi Fault, recorded microearthquakes whose precisely located epicenters clustered or aligned on the fault trace (Prevot et al., 1980). The only composite focal mechanism from this cluster had a nodal plane parallel to the fault strike. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Prevot et al. (1980); Lawrence et al. (1992); Schreiber et al. (1972); Wheeler et al. (2005)','2015-07-15 14:18:00'),(59,'Spinghar Fault','Spin Gawh','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wittekindt et al. (1997); Wheeler et al. (2005)','2015-07-15 14:18:00'),(60,'Mokur Fault','Ruleman et al. (2007) listed Mokur fault as a subdivision of the Chaman Fault System. Also spelled as Moqor (Wittekindt et al., 1997) and Moqur (Wolfart et al., 1980; Shareq, 1981), Mukur-Tarnak (Shareq, 1993) and Muqur (Shareq, 1981, 1993), and Mukur-Chaman (Sborshchikov et al., 1981).','Afghanistan',NULL,NULL,NULL,'','5.4','Mohadjer et al. (2010) used the difference in velocities of GPS sites at Quetta and Kabul to estimate an upper bound of 5.4 ± 2 mm/yr of sinistral shear across the combined Gardiz and Mokur faults.',NULL,'',NULL,NULL,NULL,'According to Ruleman et al. (2007), the Mokur fault shows evidence for Quaternary activity and has northeast-trending, continuous, linear fault scarps on piedmont and intra-basin alluvium of the Tarnak River Valley. Northwest of the main fault trace, older, discontinuous, arcuate scarps are present along the range front, suggesting southeast-verging thrust fault activity along this fault system.',NULL,NULL,NULL,'Sinistral (left lateral)',NULL,NULL,NULL,'200 km','The Mokur fault zone extends about 200 km into the northeast margin of the Helmund basin (Ruleman et al., 2007).','55','(Ruleman et al., 2007)',NULL,'Wheeler et al. (2005); Ruleman et al. (2007); Mohadjer et al. (2010);','2015-07-15 14:18:00'),(61,'Darafshan Fault','Also referred to as Tirin (Wolfart et al., 1980; Wittekindt and Wittekindt, 1997).','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,'Undated offsets reported by Trifonov (1978); Based on examination of aerial photos, Wellman (1966) reported six offset streams at a single locality west of the Chaman Fault and found one site having evidence of left-lateral strike-slip offset on the Darafshan Fault. ',NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)',NULL,NULL,NULL,'300 km','Wellman (1966) traced the Darafshan fault for 300 km. ',NULL,NULL,'The fault is mapped in a slightly different location by Wellman (1966). The traces shown here are from Ruleman et al. (2007), Wheeler et al. (2005) and Shareq and Chmyriov (1977).  ','Wellman (1966); Ruleman et al. (2007); Wheeler et al. (2005); Shareq and Chmyriov (1977)','2015-08-02 14:29:08'),(62,'Panjshir Fault','According to Wheeler et al. (2005), many authors did not name this fault but included it as the southern part of the Central Badakhshan fault or the eastern part of the Hari Rod fault. The fault is also considered as the northward extension of the Chaman fault (Mishra et al., 2012). Burtman and Molnar (1993) use the name Zebak-Munjan fault to refer to Panjshir fault. Also spelled as Panjser, Pansher, and Pansjer.','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'Shareq (1981, 1993) noted that the Panjshir fault is active according to results from earthquake concentrations and microearthquake studies. No evidence, however, was given.',NULL,NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)','Lawrence et al. (1992) suggested that left-lateral strike-slip may continue north along the aligned Chaman, Panjshir, and Central Badakhshan faults on the west, and along the aligned Gardez and Kunar faults on the east. The Panjshir fault is shown as a right lateral strike-slip fault in Faryad et al. (2013). ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Faryad et al. (2013); Mishra et al. (2012); Burtman and Molnar (1993); Lawrence et al. (1992); Shareq (1981, 1993); Wheeler et al. (2005);   ','2015-07-15 14:18:00'),(63,'Alburz-Marmul Fault Zone','Also spelled as Alburs-Mormul, Alburz-Mormul, and Alburz-Momul.','Afghanistan','North Afghan Platform ',NULL,'It is reported as a minor zone of discontinuous faults in Brookfield and Hashmat (2001).',NULL,NULL,NULL,NULL,'',NULL,NULL,'Shareq (1981) asserted that microseismic studies showed the Alburz-Marmul fault to be seismically active. However, no evidence or figures were provided to support this. According to Shareq (1993), felt crustal earthquakes were estimated to occur most frequently along the Alburz-Marmul fault. ',NULL,NULL,NULL,NULL,'Normal','Classified as an oblique slip normal fault by Brookfield and Hashmat (2001).',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wheeler et al. (2005); Brookfield and Hashmat (2001); ','2015-07-20 14:12:29'),(64,'Dosi Mirzavalan Fault',NULL,'Afghanistan','North Afghan Platform ',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip; Dextral (right lateral)','Ruleman et al. (2007) have classified the fault as right-lateral. Saibi et al. (2015), however, have classified it as left-lateral.',NULL,NULL,NULL,NULL,NULL,NULL,'Structures in the Northern Afghan platform include a network of northwest-trending, right-lateral strike-slip faults, and thrust faults where there are left steps in the strike-slip faults (Ruleman et al., 2007)','Wheeler et al. (2005); Ruleman et al. (2007); Saibi et al. (2015)','2015-07-15 14:18:00'),(65,'Bande Turkestan Fault',NULL,'Afghanistan','North Afghan Platform ','Exposed',NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip','Reported as an oblique-slip fault by  Brookfield and Hashmat (2001).',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wheeler et al. (2005); Ruleman et al. (2007); Brookfield and Hashmat (2001)','2015-07-20 14:20:38'),(66,'Helmand Fault',NULL,'Afghanistan','Central Afghanistan Accreted Terranes; Helmand basin ',NULL,'According to Ruleman et al. (2007), the Helmand fault is not as well expressed in the Helmand basin as it is to the north in the Central Afghanistan Accreted Terranes. Its location is defined by long, linear reaches of the Khash Rud River and adjacent tributaries, and by aligned volcanic centers southwest of the main range front. Ruleman et al. (2007) conclude that the Helmand fault system may be longer than shown on their map and could extend southwest to the Iranian border.  ',NULL,NULL,NULL,NULL,'',NULL,'According to Ruleman et al. (2007), the deformation rates in the Helmand basin area are substantially less than elsewhere in Afghanistan due to lack of recognizable fault-related landforms and lack of historical seismicity.  ',NULL,'In the central part of Central Afghanistan Accreted Terranes, Ruleman et al. (2007) mapped features along a linear, 90-km-long, northeast-trending range front that likely corresponds to the main trace of the Helmand fault. These features generally coincide with the bedrock-colluvium contact, and locally they observed old piedmont landforms and deposits that are left-laterally displaced. They noted that the Helmand fault system to the northeast, steps to the right, is more discontinuous and fragmented, and has little or no evidence of Quaternary activity.     ',NULL,NULL,NULL,'Strike-slip; Sinistral (left lateral)','Ruleman et al. (2007)',NULL,NULL,NULL,NULL,NULL,NULL,'Mapping done by Ruleman et al. (2007) indicates that probable Quaternary faulting is concentrated on northeast-trending lineaments that coincide with the Helmand and Dorafshan fault systems and with the Farah Rud fault to the west. They propose that these systems are acting as synthetic, sinistral conjugate shear systems to the major Chaman fault to the east. ','Ruleman et al. (2007)','2015-07-15 14:18:00'),(67,'Onay Fault','Most authors did not name this short fault that strikes northwest between the Hari Rod and Helmand faults west of Kabul (Wheeler et al., 2005)','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wheeler et al. (2005)','2015-07-15 14:18:00'),(68,'Bande Bayan Fault','Wheeler et al. (2005) note that most authors included this fault as part of the Qarghanaw fault, no variants found. ','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wheeler et al. (2005)','2015-07-15 14:18:00'),(69,'Kaj Rod Fault','According to Wheeler et al. (2005), only Chmyriov and Mirzad (1971), Wolfart and Wittekindt (1980), and UNESCAP (1995) named this short fault that crosses into Iran.','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wheeler et al. (2005)','2015-07-15 14:18:00'),(70,'Qarghanaw Fault','Also spelled as Garghanaw.','Afghanistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ruleman et al. (2007); Wheeler et al. (2005)','2015-07-15 14:18:00'),(71,'Alai Range Faults (Tien Shan)',NULL,'Kyrgyzstan, Tajikistan','Alai Range; Southern Tien Shan; Pamir',NULL,NULL,NULL,'<5','GPS velocity data from Ischuk et al. (2013)indicate shortening at <5 mm/yr north of the Trans-Alai thrust, across the South Tien Shan and between the Ferghana Valley and Eurasia. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Some of the traces for the Alai Range faults are based on a map from Mechie et al. (2011) which was strongly modified from Vlasov et al. (1991), Schwab et al. (2004) and their own observations. Other traces come from a map from Coutand et al. (2002) which was compiled based on field observations and published data (Kozlov and Artemov, 1964; Razvalyaev et al., 1964; and Arrowsmith and Strecker, 1999). Schurr et al. (2014) classify these traces as Cenozoic faults that are not likely to be active. \r\n\r\nDetailed structural and geologic cross sections described in Coutand et al. (2002) illustrate the evolution of the structures along the external southern flank of the Alai Range, where deposits are increasingly deformed and eroded from east to west. Coutand et al. (2002) suggest that significant shortening in the northern Pamir and southern Tien Shan started between late Oligocene and early Miocene time and continued episodically until the present day.     ','Mechie et al. (2011);  Vlasov et al. (1991); Schwab et al. (2004);  Kozlov and Artemov (1964); Razvalyaev et al. (1964); Arrowsmith and Strecker (1999); Coutand et al. (2002);   ','2015-08-02 10:44:37'),(72,'Minle-Damaying fault','The southernmost fault of the North Frontal Thrust system, separating the eastern Qilian Shan to the south from the Minle Basin to the north. ','China','Qilian Shan mountains, Tibetan Plateau, Hexi Corridor  ',NULL,NULL,NULL,NULL,NULL,NULL,'0.83','1.91','Horizontal shortening rates from optically stimulated luminescence and radiocarbon dating of strath terraces (Xiong et al., accepted).  ',NULL,'Xiong et al. (accepted) documented well-developed and deformed latest Quaternary terraces along the Xie River. ',NULL,NULL,NULL,'Thrust',NULL,'35 ± 5 ','The fault dips southward at an angle varying along the strike. On the west bank of the Xie River, a surface dip of 35 ± 5 degrees of the fault has been measured in the field (Xiong et al., accepted).  ',NULL,NULL,NULL,NULL,NULL,NULL,'2017-12-04 14:56:26'),(73,'Tajik-Afghan Depression Faults','Tadjik Basin ','Tajikistan; Afghanistan; Uzbekistan','Tajik Depression',NULL,NULL,'','11','GPS measurements by Mohadjer et al. (2010) show a component of relative movement parallel to the Darvaz-Karakul fault of 11 ± 2 mm/yr. Some of this motion can be absorbed by minor strike-slip faulting within the sedimentary rock of the Tajik Depression. Relative velocities between two GPS points in Khorog and Shaartuz confirm shortening rate of 6.2 ± 1 mm/yr across most of the depression (Mohadjer et al., 2010).  ',NULL,'',NULL,NULL,NULL,'Evidence for late Quaternary strike‐slip displacement along some faults in the Tajik Depression are documented by Trifonov (1978), Nikonov (1970), Legler and Przhiyalgovskaya (1979).',NULL,NULL,NULL,'Thrust','Mostly thrust with the exception of some  strike-slip faults including the Darvaz-Karakul and the Illiac faults.','','',NULL,NULL,NULL,NULL,'Tajik depression seems to be underlain by thin continental curst. Seismic reflection and geological cross sections across the depression indicate a thick 10-20 km sequence of clastic and calcareous sedimentary rock deposited on a think layer of Jurassic salt (Molnar et al., 2010). The ranges and valleys within the depression are the results of folding and faulting of the overlying strata a the sedimentary rock slides with little resistance on the weak salt layer. Minor strike-slip faulting within the sedimentary rock of the depression allow for some of the geodetically estimated slip rate of 11 ± 2 mm/yr (Mohadjer et al., 2010) to be absorbed there. ','Schurr et al. (2014); Molnar et al. (2010); Mohadjer et al. (2010)','2015-07-16 08:44:43'),(74,'Vakhsh Thrust System','The Vakhsh Thrust System is an active thrust front of the Pamir Thrust System (Schurr et al., 2014). ','Tajikistan','Alai Valley; ',NULL,NULL,'15 + 4/−2',NULL,'The Vakhsh fault shows shortening rates of 15 + 4/−2 mm/yr and dextral shear rates of 16 ±3 mm/yr (Metzger et al., 2020)',NULL,'',NULL,NULL,'The 1949 M 7.4 Khait earthquake occurred on the Vakhsh Thrust System or on faults in the Tien Shan (Schurr et al., 2014; Leith and Simpson, 1986a; Nikonov, 1988; Evans et al., 2009) ',NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Vakhsh Thrust System extends into the dextral-reverse lateral ramp of the Illiac Fault Zone, bounding the thrust-fold belt of the Tajik-Afghan basin in the north. Its eastward continuation along the southern Alai valley is a shallow dipping decollement along Jurassic evaporates (Schurr et al., 2014).   ','Schurr, et al. (2014), Metzger et al. (2020)','2020-06-18 11:10:46'),(75,'Tashkorgan Fault',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Normal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr, et al. (2014)','2015-07-15 14:18:00'),(76,'Tam Karaul Fault',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr, et al. (2014); Cowgill (2010)','2015-07-15 14:18:00'),(77,'Tiklik Fault',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Schurr, et al., 2014; Cowgill, 2010','2015-07-15 14:18:00'),(78,'Oldham Fault',NULL,'India','Shillong Plateau',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The 1897 Assam earthquake (Bilham and England, 2001).',NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Clark and Bilham (2008)','2015-07-17 09:55:20'),(79,'Pamir Frontal Thrust','The Pamir Frontal Thrust is a zone of active thrust faulting subdivided into several segments (i.e., Biertuokuoyi frontal thrust and the Mayikake thrust, and further east, Tumuluoan thrust and anticline). ','China','Pamir',NULL,NULL,'6','9','A convergent rate of 6-9 mm/yr along the Pamir Frontal Thrust is suggested by Li et al. (2012). This rate is based on the slip rate value of 7.95 ± 1.9 mm/yr reported by  Zubovich et al. (2010) and Yang et al. (2008). ',NULL,'6','7','Based on dated and faulted fluvial terraces, magnetostratigraphy, and mapping, the horizontal shortening rate of 6–7 mm/yr at time scales of both 18.4 ka and 0.35 Ma was estimated for the Pamir Frontal Thrust (adjacent to the Mayikake basin, ~75 km west of Kashgar) by Li et al. (2012).','The 1985 Wuqia M7.4 event (Feng, 1994).',NULL,NULL,NULL,NULL,'Thrust','According to Li et al. (2012), the Pamir Frontal thrust is a zone of active thrust faulting and folding, and it includes the Biertuokuoyi Frontal Thrust and the Mayikake Thrust, the Tuomuluoan Thrust and thrust-related Tuomuluoan anticline.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-12-06 16:05:02'),(87,'North Lunggar Detachment',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Styron, et al. (2010); Taylor, et al. (2009); Kapp et al. (2008)','2015-07-15 14:18:00'),(88,'Palung Co fault',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Styron et al. (2010) Taylor et al. (2009); Elliot et al. (2010);','2015-07-15 14:18:00'),(89,'Lopukangri Rift',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-15 14:18:00'),(90,'Narin Thrust',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-15 14:18:00'),(91,'Adatan Thrust',NULL,'China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yin et al. (2008)','2015-07-15 14:18:00'),(96,'The Gurla Mandhata - Humla Fault System ','Also referred to as the Gurla Mandhata Detachment. Also see Humla Fault.','Nepal, China',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Murphy and Copeland (2005) estimated the net slip on the southern branch of the GMH to be 21 km. They did not identify offset markers along the northern branch, but were able to estimate extension across the shear zone using sheared dikes, yielding shear strains between 1.7 and 5.7. This estimation yielded 11.4 to 3.4 km of right-lateral shear (minimum slip) accommodated by the entire width of the northern branch of the GMH, 2 km.   ',NULL,NULL,NULL,'232Th/208Pb ion microprobe monazite ages from deformed and undeformed leucogranite bodies indicate the Gurla Mandhata - Humla Fault Sytsem was active between the middle to late Miocene. ',NULL,'Dextral (right lateral), Normal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Gurla Mandhata - Humla Fault System is a transtensional system that cuts across the Tethyan fold-thrust belt, South Tibet Detachment, Greater Himalayan Crystalline sequence, the Main Central thrust zone, and into the Lesser Himalayan sequence (Murphy and Copeland, 2005). This fault system and the associated shear zones are described in detail in Murphy and Copeland (2005).  ','Murphy and Copeland (2005);  ','2015-07-15 14:18:00'),(97,'Gyaring Co Fault',NULL,'China','Lhasa Terrane; Southern Tibet',NULL,NULL,'12.3','14.5','Taylor and Peltzer (2006) estimated the slip rate and locking depth of the\r\nfault using the 3 independent interferograms. The optimal fault\r\nparameters are consistent with a right-lateral fault slipping at a rate between 12.3 and 14.5 mm/yr for the phase profiles. The mean data dispersion on these profiles ranges between 2.5 and 3.7 mm/yr yielding an error interval on the slip rate of 10.2 – 18.3 mm/yr. The\r\ncorresponding locking depth varies between 23 and 27 km. After investigating the effect of varying the tilt in the profile, the conservative bracket for the error on the fault slip rate became 7.5– 20.8 mm/yr. ','See: Taylor and Peltzer (2006) ','',NULL,NULL,'Armijo et al. (1989) documented evidence for a rupture near Xianza which they attribute to an earthquake of M7.  ','Field and satellite observations along the trace of the Gyaring Co fault suggest recent activity with the fault trace cutting Quaternary alluvial fans and terrace risers, and locally forming pressure ridges and sag ponds (Taylor and Peltzer, 2006).',NULL,NULL,NULL,'Dextral (right lateral)','Taylor et al. (2009)',NULL,NULL,'250 km',NULL,'N70W',NULL,'The northern end of the Gyaring Co Fault merges with the southern end of the Riganpei Co fault along the Bangong-Nujiang suture, and its southern end is linked\r\nwith the north trending Pum-Qu-Xainza rift (Taylor and Peltzer, 2006).','Taylor et al. (2009); Taylor and Peltzer  (2006)','2015-07-15 14:18:00'),(104,'Riganpei Co Fault','The Riganpei Co fault comprises the northern segment of the Dong Co conjugate strike-slip fault system. ','China','Central Tibet',NULL,NULL,NULL,NULL,NULL,'Taylor and Peltzer (2006) estimated a conservative interval of 3.4 –11 mm/yr for the slip rate on the Riganpei Co Fault. The model slip rate and the locking depth that best fit their data are 6.6 mm/yr and 15 km, respectively. ','',NULL,NULL,NULL,'CORONA satellite image of the Riganpei Co fault shows offset alluvial cones overlying\r\nregressive shorelines of adjacent lake (Taylor and Peltzer, 2006)\r\n\r\n',NULL,NULL,NULL,'Sinistral (left lateral)',NULL,NULL,NULL,'120 km',NULL,'N71E',NULL,'The fault connects with the central segment of the Yibug Caka rift system to the north,\r\nand with small west dipping normal faults that connect with the Bangong-Nujiang suture zone to the south. ','Taylor and Peltzer (2006)','2015-07-15 14:18:00'),(106,'North Qaidam Thrust Belt','Also known as North Qaidam Thrust System (Yin et al., 2008). ','China','Qaidam basin',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,'500 km',NULL,NULL,NULL,'The North Qaidam thrust system is located in the southernmost part of the Cenozoic Qilian Shan-Nan Shan thrust belt (Yin et al., 2008). It consists of several structures including the Saishiteng thrust zone which includes the Dasaibei thrust in the north and the Xiaosaibei thrust in the south, the Sainan thrust zone, the Qaidam Shan thrust zone, the Western and Eastern\r\nLuliang thrusts, the Xitie Shan thrust zone, Olongbulak thrust zone, the Aimunik thrust zone, and the Lenghu anticlinorium. Description of each structure is provided in Yin et al. (2008). ','Yin et al. (2008)','2015-07-15 14:18:00'),(107,'Haiyuan Fault','Also referred to as the Haiyuan Fault Zone (Burchfiel et al., 1991)','China','Eastern Tibet','Exposed','The entire length of the fault can be seen\r\nclearly on satellite imagery (e.g., Deng Qidong et al., 1984; Tapponnier and Molnar 1977) and in the field.','4.2','8','For the eastern part of the fault, repeated GPS measurements yield a rate of 4.3 ± 1.5 mm/yr. Repeated satellite interferometry\r\nmeasurements give a rate of 4.2–8 mm/yr (Cavalié et al., 2008).',NULL,'4.2','20','Geologic rates estimated by Li et al. (2009) yields the following upper and lower bounds on slip rates for three sites in the eastern section of the fault: 4.2 ± 0.8, 4.5 ± 0.7, and\r\n5.0 ± 2.5 mm/yr. Lasserre et al. (1999, 2002) estimated slip rates for three sites farther west: 12 ± 4, 10.5 ± 1.4, and 19 ± 5 mm/yr. Molnar et al. (2010) suspect that rates reported by Lasserre et al. are upper bounds and conclude that slip on this fault is slower than 10 mm/yr and unlikely to exceed ~5 mm/yr. \r\n\r\nBased on 10Be–26Al surface exposure ages of glacial moraines in the Lenglong Ling range and 14C dating of fluvial terrace risers near Songshan, Tapponnier et al. (2001) estimated two slip rate values of 20 ± 5 mm/yr and 12 ± 4 mm/yr, averaged over time spans of about 11 000 and 14 000 years, respectively. \r\n\r\nGaudemer et al. (1995) obtained a Holocene horizontal slip rate of 11 ± 4 mm/yr for the western Haiyuan Fault at Sange Dun location.  \r\n\r\nBurchfiel et al. (1991) suggest an average slip rate between 5 and 10 mm/yr, assuming the slip began near the end of the Pliocene time or earliest Pleistocene. This rate is estimated by left-slip offset of between 10.5 and 15.5 km of different geological features. The dates for Smaller offsets on younger geologic features are too imprecise to constrain slip rates. This fault zone does not seem to accommodate large-scale eastward lateral transfer of continental fragments in the northern Tibetan Plateau.   \r\n\r\nBased on offset landforms and radiocarbon dates, Zhang et al. (1988) estimated a left-slip rate of 8 ± 2 mm/yr for the eastern segment of the fault. \r\n\r\nLiu and Zhou (1986) inferred from offset Holocene ridges and creeks an average long-term slip rate of about 5 mm/yr. \r\n','The 1920 Haiyuan earthquake of M 8.7 ruptured the eastern 200 km of the fault, producing surface ruptures that show mostly left-slip displacement with magnitudes of more than 10 m in some places (Burchfiel et al., 1991).','Terrace offsets (Tapponnier et al., 2001)',NULL,'Paleoseismological studies indicate a slip rate of about 5 mm/yr (Li et al., 2009)',NULL,'Sinistral (left lateral)',NULL,NULL,'Nearly vertical',NULL,NULL,'N60-65W',NULL,NULL,'Cavalié et al. (2008); Tapponnier et al. (2001); Gaudemer et al. (1995); Burchfiel et al. (1991); Zhang et al. (1988); Deng Qidong et al. (1984); Tapponnier and Molnar (1977);  ','2015-07-15 14:18:00'),(108,'Jiali Fault','The easternmost branches of the Jiali Fault zone are the Puqu and Parlung faults. The Jiali Fault bounds the Karakoram-Jiali fault zone in the east (Lee et al., 2003). \r\n\r\n','China','Eastern Tibet',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,'Long-term rate of ~15 mm/yr (Armijo et al., 1989)','The Jiali Fault is affiliated with the M8.7 Assam (or Chayu) earthquake of August 15, 1950 (Molnar and Deng, 1984).',NULL,NULL,NULL,NULL,'Strike-slip; Dextral (right lateral)','The motion of the Jiali fault is a combination of dextral strike-slip and thrust components (Lee et al., 2003).',NULL,NULL,NULL,NULL,NULL,NULL,'Lee et al. (2003) suggests that the Jiali\r\nright slip fault was active between 18 and 12 Ma. The InSAR analysis by Taylor and Peltzer (2006), however, points to initiation timing of 2-3 Ma.   ','Armijo et al. (1989); Taylor and Peltzer (2006)','2015-07-17 10:58:25'),(109,'Xianshuihe-Xiaojiang Fault System',NULL,'China','Tibet; Central Yunnan; Western Sichuan',NULL,NULL,'2','12','GPS data from Wang et al. (1998) indicate velocities of n<2. Initial GPS measurements suggested a rate of ~10 mm/yr for the Xianshuihe fault (Chen et al., 2000), and results from a denser network yield a rate of 10 ± 2, 10 ± 2, and 11 ± 2 mm/yr across the western, central, and eastern sections of that fault (Shen et al., 2005; Molnar et al., 2010). Recent analysis of InSAR data from 1998 to 2008 yields a rate of 9–12 mm/yr for the Xianshuihe fault (Wang et al., 2009; Molnar et al., 2010).','Recent analysis of InSAR data from 1998 to 2008 yields a rate of 9–12 mm/yr for the\r\nXianshuihe fault (Wang et al., 2009; Molnar et al., 2010).\r\n','7.2','30','According to Wang et al. (1998), total displacement along the fault system is about 60 km, the displacement began at least by about 4 Ma, and long-term slip rates range from 2-8 mm/yr on faults with small displacement to 9-28 mm/yr on faults with large displacement. Total left-lateral displacement on fault system remains uniform along most of its length although displacement is locally partitioned onto several faults. \r\n\r\nHolocene rate of 15 ± 5 mm/yr (Allen et al., 1991); Holocene rate of 7.2 mm/yr for the central segment (Wen et al., 1996); 15-30 mm/yr of average slip for the past 2-4 Myr (Wang et al., 1998); 9.6 ± 1.7 mm/yr and about 14 mm/yr Holocene slip across northwest and central sections of the fault reported by Li et al. (1997) and Xu et al., (2003).\r\n',NULL,NULL,NULL,NULL,NULL,'Sinistral (left lateral)',NULL,NULL,NULL,'> 1200 km',NULL,NULL,NULL,NULL,'Styron, et al., 2010; Taylor, et al., 2009; Wang, et al., 1998; Shen et al., 2005; Molnar et al., 2010; ','2015-07-15 14:18:00'),(110,'Sagaing Fault','Also referred to as the Sagaing Fault Zone.','Myanmar',NULL,NULL,'The central 700 km of the fault is linear (17°N–23°N), with clearly defined morphology between Swebo and Mandalay (22°N), but is more difficult to trace southward on Satellite images and in the field (Vigny et al., 2003).',NULL,'18','18 mm/yr or lower as estimated by Vigny et al. (2003). This rate, however, changes along the fault trace (e.g., 14 mm/yr near the south coast to 18 mm/yr north of latitude 25.5 °N according to Yeats, 2012). \r\n',NULL,'10','38','Based on dating an offset of a basalt flow (0.25–0.31 Ma), Bertrand et al. (1998) suggested lower and upper bounds of 10 ± 1 and 23 ± 3 mm/yr for the slip rate. \r\n\r\nOther estimates include 16 mm/yr (between 4 and 2 Ma) and 38 mm/yr since that time, or an average of 18-19 mm/yr (Curray, 2005; Raju et al., 2004). Molnar et al. (2010) do not find these data to constrain the slip rate well. \r\n\r\n\r\n\r\n','The following earthquakes for the Sagaing fault (from north to south) are from the Gutenberg and Richter catalog: M7.6 in 1931, M7.4 in 1946, M7.0 in 1956, and another in 1839, M7.3 in 12/1930, M7.3 in 05/1930.  ','Vigny et al. (2003)\r\n',NULL,NULL,NULL,'Dextral (right-lateral); Strike-slip ',NULL,NULL,NULL,'1200 km',NULL,NULL,NULL,NULL,'Vigny et al. (2003); Bertrand et al. (1998); Curray (2005); Raju et al. (2004);  Molnar et al. (2010);\r\n','2015-07-15 14:18:00'),(116,'Longmen Shan Fault Belt','Also see Beichuan Fault, Pengguan Fault, Wenchuan-Maowen Fault, and Hanwang Fault. Densmore et al. (2007) use the names Beichuan and Pengguan faults to refer to presently active structures in the Longmen Shan. ','China','Sichuan Basin, Longmen Shan; Eastern Tibet',NULL,NULL,'1','4','<1-3 mm/yr (King et al., 1997; Chen et al., 2000; Shen et al., 2005); GPS surveys constrain active shortening across the entire Longmen Shan to 4.0 ± 2 mm/yr relative to the Sichuan Basin (Zhang et al., 2004); GPS results from Meng et al. (2008) imply that the Longmenshan Fault has both right-lateral slip rate and compressional rate close to 2.0 ± 1.0 mm/yr.',NULL,'1','10','Based on dating of depositional surfaces using cosmogenic radionuclides,  Densmore et al. (2007) reported <1 mm/yr latest Quaternary apparent throw rates for the Beichuan and Pengguan faults. Their reported rates of strike-slip displacement are ~1-10 mm/yr but remain poorly constrained.  ','Mw 8.0 Wenchuan earthquake in 2008 (Burchfiel et al., 2008). This event ruptured about 270 km along a west-dipping fault in the Longmen Shan thrust Belt (Taylor and Yin 2009).','In the Longmen Shan region, most of the geomorphic indicators of fault slip involve deformation of depositional surfaces or landforms such as fluvial fill terraces or sediment fans (Densmore et al., 2007).','Densmore et al. (2007) excavated two trenches across the Pengguan and Beichuan faults to establish the timing of the most recent slips on both faults. Ran et al. (2010) excavated trenches in three locations (i.e., Leigu, Xiaoyudong, and Bailu) in the middle segment of the Beichuan-Yingxiu fault and Jiangyou-Guanxian fault of the Longmenshan fault zone. revealing one or two paleoearthquakes that occurred before the 2008 Wenchuan earthquake. A trench excavated by Ran et al. (2013) at Yingxiu town on the scarp of the Beichuan-Yingxiu fault, reveals three paleoseismic events, constraining the age of the penultimate event between 3300 and 2300 cal BP.  ','Using different methods, the recurrence intervals estimated for large earthquakes include 3000-6000 years from geologic and GPS convergence rates (Zhang et al., 2008), 4000 years from coseismic slip distribution and geodetic and geologic slip rates derived from InSAR and GPS inversion (Shen et al., 2009), and 10,000 years from trenching and radiocarbon and OSL dating (Li et al., 2010). From geomorphic analysis, Ran et al. (2008, 2010) revealed that the penultimate earthquake occurred between 2300 a BP and 3300 a BP. Ran et al. (2013) aimed at narrowing down uncertainties associated with above results. They concluded an average recurrence interval of 3000 years based on a trench investigation, geomorphic analysis and radiocarbon dating.       ',NULL,'Dextral (right-lateral); Strike-slip','Observations made by Densmore et al. (2007) show that the Pengguan fault has been active in the Holocene as a dextral strike-slip fault with a minor and locally variable apparent dip-slip component. Their observations of the Beichuan fault shows abundant evidence for Quaternary dextral strike-slip displacement with minor and locally variable components of dip slip.\r\n   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Styron, et al. (2010); Taylor, et al. (2009); Burchfiel, et al. (1995); Kirby, et al. (2000); Densmore et al. (2007); Meng et al. (2008);','2015-08-13 08:55:59'),(117,'North Afghan Platform Faults','North Afghan Platform faults as defined by Ruleman et al. (2007) include the Alburz Marmul, Andarab, Bande Turkestan, Herat, Andarab, Darvaz-Karakul, Central Badakhshan, and Panjshir faults.','Afghanistan','North Afghan Platform',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Most faults, with the exception of the Darvaz-Karakul fault, in this region seem to be only sparsely seismically active.','Most faults lack significant offsets (Wheeler et al., 2005; Brookfield and Hashman, 2001). Where known, offsets are right-lateral.  ',NULL,NULL,NULL,'Strike-slip; Dextral (right lateral); thrust','Most faults in this region show dextral strike-slip motion that connect southeast-verging thrust faults (Ruleman et al., 2007).',NULL,NULL,NULL,NULL,NULL,'Most faults strike east-west.','The fault traces highlighted on the database map are from Taylor and Yin (2009), and have been classified as thrust faults. ','Ruleman et al. (2007); Wheeler et al. (2005); Taylor and Yin (2009); Brookfield and Hashman (2001);','2015-07-20 14:04:05'),(118,'Shangxi Graben System','Spelled Shansi Graben System in Molnar et al. (1975).','China','Shangxi Graben',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,'Nineteen earthquakes of a magnitude\r\nequal to or larger than 6 have occurred since 231 AD including the Hongdong earthquake of magnitude 8 in 1303, and the Linfen earthquake of magnitude 7.5 in 1695, both of which occurred in the middle part of the graben system. More recent earthquakes include an earthquake swarm of magnitude 4-5 in 1986 in the Yuncheng Basin\r\nand a swarm of magnitude 5.6–6.1 in 1989 in the eastern part of the Datong Basin (Li et al., 1998). ','Geomorphic expressions include deformed terraces and and shifting of river courses (Li et al., 1998)',NULL,NULL,NULL,'Normal; Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Shanxi Graben System is composed of a series of normal fault-controlled basins. \r\n\r\nThese faults are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009); Burchfiel et al. (1991); Y Li et al. (1998); Molnar et al. (1975); ','2015-07-15 14:18:00'),(122,'Bue Co Conjugate Fault System','The southern segment of the Bue Co conjugate fault system is the right-slip Lamu Co fault. The northern segment is the Bue Co Fault. The system is located 400km to the west of the Dong Co conjugate system.  \r\n\r\n','China','Central Tibet',NULL,NULL,'2.6',NULL,'Taylor and Peltzer (2006) estimated a slip rate of 2.6 +1.6 –0.9 mm/yr for the right-slip Lamu Co Fault which is the southern segment of the Bue Co Conjugate Fault System.',NULL,NULL,NULL,NULL,NULL,'The fault trace cuts several alluvial fans as observed in Landsat imagery (Taylor and Peltzer, 2006; Taylor et al., 2003). ',NULL,NULL,NULL,'Sinistral (left lateral)','The Bue Co fault is a left-lateral strike-slip fault with a small dip-slip component (Taylor and Peltzer, 2006).',NULL,NULL,NULL,NULL,'N70',NULL,NULL,'Taylor and Peltzer (2006); Taylor et al. ( 2003); ','2015-07-15 14:18:00'),(123,'Dong Co Conjugate Fault System','The Dong Co conjugate fault system is composed of the left-slip Riganpei Co Fault to the north and the right-slip Gyaring Co Fault to the south. The system is centered on the Bangong-Nujaing suture zone (Taylor and Peltzer, 2006).  ','China','Central Tibet; Shuang Hu Graben; Southern Tibet',NULL,NULL,'3.4','20.8','Based on InSAR observations and fault model adjustment, Taylor and Peltzer (2006) estimated a conservative interval of 3.4-11 mm/yr of slip on the left-lateral Riganpeo Co Fault which is the northern segment of the Dong Co Conjugate Fault System. Their model slip rate and locking depth that best fit their data are 6.6 mm/yr and 15 km for the Riganpeo Co Fault. Using the same methods, they estimated a conservative slip rate of 7.5-20.8 mm/yr for the right-lateral Gyaring Co Fault. Their model slip rate that best fit their data is between 12.3-14.5 mm/yr.   ',NULL,'','0.3','Blisniuk and Sharp (2003) estimated a cumulative vertical slip rate of 0.3 mm/yr during the late Quaternary on a range bounding normal fault in the Shuang Hu graben based on dating offset fluvial terraces using U- series. ',NULL,NULL,NULL,NULL,NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Taylor and Peltzer (2006); Blisniuk and Sharp (2003);   ','2015-07-15 14:18:00'),(125,'Tien Shan Faults','Some of the Major faults of the Tien Shan  are: Issyk-Ata Fault, Akchop Hills and South Kochkor Faults, Kadjerty and Central Naryn Faults, Oinak-Djar Fault, North and South Kyrkungey Faults, South Tien Shan Fault, Talas Fergana Fault, Karatau Fault, and Gobi-Tien Shan Fault.\r\n','Kyrgyzstan; China; Kazakhstan; Tajikistan','Tien Shan; Fergana Valley; Alai Range',NULL,'In central Tien Shan, Holocene and late Pleistocene traces are discontinuous, with alternating buried and exposed fault tip lines and many fault lengths are shorter than the basins and ranges they occupy or bound (Thompson et al., 2002). ','','','Abdrakhmatov et al. (1996) estimated ~12–13 mm/yr north-south shortening rate which is broadly distributed across the northern\r\ntwo thirds of the central Tien Shan. They inferred a total shortening rate for the Tien Shan of ~20 mm/yr.',NULL,'',NULL,'Thompson et al. (2002) reported late Quaternary slip rates of 0.1-3 mm/yr for 8 faults in Central Tien Shan.',NULL,'Some of the common geomorphic features include faulted and folded river terraces (Thompson et al., 2002).','See the work of Rubin et al. (1999).','Paleoseismic data from trench excavations suggest that major ground-rupturing earthquakes on individual faults recur on the order of one to several (1-5) thousands of years (Rubin et al., 1999).',NULL,'Thrust; Reverse','Focal mechanisms from moderate and large earthquakes indicate primarily thrust and reverse faulting in the central Tien Shan. Several faults show evidence for dextral or sinistral components of motion, but most of the late Quaternary faults indicate dominantly dip-slip motion with the exception of the right-lateral strike-slip Talas-Ferghana Fault located to the west of Central Tien Shan (Thompson et al., 2002). ',NULL,NULL,NULL,NULL,NULL,'Most faults in central Tien Shan strike east-west to east-northeast. ','Most fault traces in Central Tien Shan are from Thompson et al. (2002) and are based on satellite and air photo interpretation, field observations and previous studies. Additionally, they reported late Quaternary slip rates on eight faults in five basins ranging from ~0.1 to ~3 mm/yr, suggesting that deformation is concentrated along major fault zones near range-basin margins. \r\n\r\nSome fault traces are from Taylor and Yin (2009) and Styron et al. (2010) and are based on field observations or interpretations of satellite images and digital topography data. \r\n\r\nFault traces in the Alai Range are from Mechie et al. (2011) and Coutand et al. (2002).','Styron et al. (2010); Taylor et al. (2009); Thompson et al. (2002); Allen et al. (1999); Tapponnier and Molnar (1979); Coutand et al. (2002); Mechie et al. (2011);','2015-08-02 13:07:48'),(126,'Zailisky Alatau Rangefront',NULL,'Kazakhstan','Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,'1.2','2.2','Holocene slip rate based on radiocarbon dating of uplifted river terraces in the eastern section (Grützner et al., 2017).','Fault scarps in alluvial fans indicate that surface rupturing earthquakes have occurred along the rangefront fault since the Last Glacial Maximum, with minimum estimated magnitudes of M6.8-7. However, it is not clear if these scarps represent single-event scarps or cumulative offsets. Paleoseimological studies could determine that (Grützner et al., 2017).','Post Last Glacial Maximum tectonic activity along the Almaty rangefront is expressed in fault scraps in alluvial fans, folding, uplifted abandoned river terraces, and backthrusts (Grützner et al., 2017).',NULL,NULL,NULL,'Thrust',NULL,'30-60 degrees','The dip is assumed to be 30-60 degrees (Grützner et al., 2017).','>250 km',NULL,NULL,NULL,NULL,NULL,'2017-12-04 13:16:03'),(127,'Main Boundary Thrust','The Main Boundary Thrust is a general term for a thrust zone, represented by a series of individual thrusts along strike with their roots in the basal decollement of the Himalaya. It is named Murree Thrust in McDougall (1998). ','Pakistan, India, Nepal','Western Himalaya','Exposed','The fault is expressed in bedrock along the Himalayan arc, and is locally observed to displace Quaternary deposits (Kumar et al., 2011)',NULL,NULL,NULL,NULL,'',NULL,NULL,'Microearthquake surverys conducted by Kayal et al. (1993) show subcrustal earthquakes down to a depth range of about 50-80 km to the south of the Main Boundary Thrust with focal mechanisms indicating strike-slip solutions or deep-seated transverse tectonics.',NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Main Boundary Thrust is the southernmost thrust that places metasedimentary rocks of the lesser Himalaya over unmetamorphosed clastic rocks of the Himalayan foredeep (Meigs et al., 1995)','Meigs et al. (1995); Kumar et al. (2011); Kayal et al. (1993); McDougall (1998); Kazmi and Rana (1982);','2015-07-15 14:18:00'),(128,'Ganzi Fault','Also named Garzê-Yushu Fault. The Xian Shuihe and Garzê-Yushu faults appear to be continuations of one another (Molnar et al., 2010).','China','Eastern Tibet',NULL,NULL,NULL,NULL,'GPS data from the Garzê-Yushu fault, however, are too sparse to constrain the rate (Molnar et al., 2010).',NULL,'7','12','7 mm/yr of average late Quaternary slip (Zhou et al., 1997); 12 ± 2 mm/yr of average slip for the last 50,000 years (Wen et al., 2003); upper bound rate of 10 ± 2 mm/yr (Wen et al., 2005); lower bound of 8 mm/yr assessed from dates given by Wen et al. (2005) for terraces above offset terrace risers (Molnar et al., 2010).     \r\n\r\n','The 1896 earthquake occurred on the northwestern segment (west of Luoxu) of the fault. No large earthquake has been recorded for the middle and southeastern segments of the fault (east of Luoxu) despite visible surface ruptures of unknown-age earthquakes on the middle and southeastern segments. Wen et al. (2003) investigated these surface ruptures and concluded that all segments of the fault are capable of producing large earthquakes.    ','Various types of well-preserved offset landforms (e.g., fault scarps, offset moraines, pressure ridges and deflected streams abd rivers have been reported by Wen et al. (2003) and Wang and Burchfield (2000).   ',NULL,NULL,NULL,'Sinistral (left-lateral); Strike-slip',NULL,NULL,NULL,'300',NULL,NULL,NULL,NULL,'Styron et al. (2010); Taylor et al. (2009); Taylor et al. (2003); Wang and Burchfiel (2000); Wen et al. (2003); Molnar et al. (2010); ','2015-07-15 14:18:00'),(130,'Mohand Thrust','A segment of the Himalayan Frontal Thrust.','India',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Wesnousky et al. (1999)','2015-07-15 14:18:00'),(131,'Kirthar-Sulaiman Faults','The faults include the Kirthar-Sulaiman Front Fault (Nakata et al.,1990), the Sulaiman fold-thrust belt, and the left-lateral, strike-slip Kingri fault.    ','Pakistan','Kirthar Range; Sulaiman Range; Kirthar-Sulaiman',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,'Based on an analogue model of Bernard et al. (2000), thrusting in NW-SE direction in the Sulaiman Range accommodates 5-14 mm/yr of N-S motion between India and Eurasia and 3-6 mm/yr of E-W shortening. \r\n\r\n\r\nJadoon et al. (1994) suggested a shortening rate of about 18 mm/yr, based on shortening estimates in the cover strata of the Sulaiman fold-and-thrust belt of about 378 km over 21 m.y. \r\n\r\nUsing a relative motion model, Minster and Jordan (1978) estimated the relative motion of the Indian and Eurasian plates to be 40 mm/yr in NNW-SSE direction along the Kirthar-Sulaiman Front. \r\n\r\nVelocities measured over 8 years in the Sindh region including the Ornach/Nal segment of the Chaman fault are negligible (Khan et al., 2008). ','Bernard et al. (2000) solved for the source parameters of 10 events that occurred between 1964 and 1985 in the Sulaiman region. The focal mechanisms show predominantly thrust faulting, and the seismic moment release constitutes about 40% of the expected total seismic moment release for this century. Other Sulaiman Range earthquakes include the 1993 earthquake at the foot of the Brahui Range which could be related to either the Brahui Range or to the Sulaiman Range to the east, the M7.1 Kachhi earthquake in 1909 which caused extensive damage on the south side of the Sulaiman Range, the 1997 M7.0 earthquake which occurred in the Sibi region followed by two more shallow strike-slip events in 2008 of M6.4 in the same region (Yeats, 2012).     ',NULL,NULL,NULL,NULL,'Thrust','Mostly thrust with a few exceptions such as the strike-slip Kingri fault. ',NULL,NULL,NULL,'The Sulaiman lobe is a broad (>300 km) fold and thrust belt.','N-S and E-W','Structures in the Sulaiman Range show a north-south strike while south of the Sulaiman Range in the Sulaiman Lobe, structures show a nearly east-west strike. In the Kirthar Range, structures strike north-south.   ','The fault traces located within the Kirthar and Sulaiman ranges are from Kazmi and Rana (1982). These include the faults and folds of the Bella-Chaman-Kurram fault zone, Himalayan fold belt, and Sulaiman-kithar fold belts. The Kirthar-Sulaiman Front Fault (Nakata et al., 1990) is taken from the HimaTibet map of Styron et al. (2010) and Taylor and Yin (2009) where it is named Makran Thrust Belt. These faults mark the boundary between the Indian and Eurasian plates which is topographically marked by the eastern foot of the Kirthar and Sulaiman Ranges facing the Indus Plain (Nakata et al., 1990).    ','Nakata et al. (1990); Minster and Jordan (1978); Kazmi and Rana (1982); Lawrence et al. (1992); Styron et al. (2010); Taylor et al. (2009); Jadoon et al. (1994);  ','2015-07-15 14:18:00'),(132,'Salt Range Front Fault','Also referred to as Salt Range Thrust. The Salt Range Thrust may be the western part of the Main Frontal Thrust of the Himalaya (Baker et al., 1988). ','Pakistan',NULL,NULL,NULL,NULL,'3','GPS measurements by Khan et al. (2008) on the Potwar plateau (including the Salt Range) show that the plateau is currently\r\nmoving southward at rates of ~3 mm/yr. ',NULL,'4','15','The observed north-south convergence rate for the Salt Range is >8-12 mm/yr (Lillie et al., 1987; Johnson et al., 1986; and Baker et al., 1988). Observations made by Meigs et al. (2012) indicate 1000\'s years between surface rupturing events, consistent with the low fault shortening rates of 4-13 mm/yr. The average shortening rate across the eastern Salt Range and Potwar Plateau since 2.5 Ma is estimated to be about 7 mm/yr (Pennock et al., 1989).',NULL,'The Salt Range fault deforms young surficial deposits (Gee, 1989; Meigs et al., 2012). ',NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','Nakata, et al. (1990); Lillie et al. (1987); Johnson et al. (1986); Baker et al. (1988); Bernard et al. (2010); Gee (1989); Meigs et al. (2012) ','2015-07-15 14:18:00'),(133,'Kalabagh Fault','Also referred to as the Kalabagh Fault Zone (McDougall and Khan, 1990) ','Pakistan','Salt Range',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,'Cumulative right-slip offset in the Kalabagh fault zone indicate a minimum avergae displacement rate of 7-10 mm/yr near the Indus River since 2 Ma (McDougall and Khan, 1990). Holocene terrace deposits are displaced and uplifted by the faulting and the course of the Indus River is shifted eastward. Based on a high slip rate and associated seismicity, McDougall and Khan (1990) conclude that the fault zone should be considered active and capable of producing large earthquakes.','Seismicity data show microearthquakes 0-30 km deep in zones parallel to and south of the Kalabagh fault zone (Seeber and Armbruster, 1979; Seeber et al., 1981).','Piercing points along the main Kalabagh Fault indicate 12-14 km of middle to late Quaternary right-lateral offset (McDougall and Khan, 1990). ',NULL,NULL,NULL,'Dextral (right lateral)',NULL,NULL,NULL,'120 km',NULL,'N15W',NULL,'Located on the western flank of the Salt Range, the Kalabagh Fault is an active fault with right-lateral slip. It was first recognized by Gee (1945, 1947, 1980) and appears on a map of active faults by Kazmi (1979) and Kazmi and Rana (1982).   ','Nakata et al. (1990); McDougall and Khan (1990); Kazmi and Rana (1982); Kazmi (1979); Gee (1945, 1947, 1980); Seeber and Armbruster (1979); Seeber et al. (1981); ','2015-07-15 14:18:00'),(134,'Junggar Fault',NULL,'China','',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Dextral (right lateral)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Allen et al. (1999);','2015-07-15 14:18:00'),(135,'Southern Tibet Faults','Includes Beng Co Fault, the Xiao Gurla Detachment, the Pum Qu-Xainza Rift, and the Tangra Yum Co Rift. ','China, India','Tibet; Southern Tibet',NULL,NULL,NULL,NULL,'Gan et al. (2007) reported dislocation rates of principal faults in southern Tibet as estimated by a dislocation model. These faults include the Nielamu, Dingjie, Yadong-Gulu, and Cuona faults as well as the Yarlung-Zangbo suture zone. The left-lateral slip rates for the Nielamu, Dingjie and Yadong-Gulu faults are 3.6 ± 1.3, 2.3 ±  1.1, 0.7 ± 1.1 mm/yr, respectively. The right-lateral slip rate for the Cuona fault and th Yarlung-Zangbo suture are 0.6 ± 1.3 and 2.5 ±  1.1 mm/yr, respectively. A dip-slip rate of 4.1 ± 1.2 mm/yr was also reported for the Yarlung-Zangbo suture.  ',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Normal','Sense of motion for most faults in southern Tibet is normal. Exceptions include strike-slip faults such as Gyaring Co (right-slip), Dong Co conjugate fault system, Bue Co conjugate fault system (right-slip). ',NULL,NULL,NULL,NULL,NULL,NULL,'The Southern Tibet faults are those that are located between the boundaries defined by the Indus-Yalu suture zone (in the south) and the Bangong-Nujiang suture zone (to the north). These faults are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures). \r\n','Styron et al. (2010); Taylor et al. (2009); Hager et al. (2006); Taylor and Peltzer (2006); Dewane et al. (2006);','2015-07-21 13:53:50'),(136,'Central Tibet Faults','Includes the Bue Co Conjugate fault system, Dong Co Conjugate fault system, and Riganpei Co fault. ','China','Central Tibet',NULL,NULL,NULL,NULL,'GPS studies show 15-20 mm/yr of east-west extension and about 10 mm/yr of north-south contraction for strike-slip faults in Central Tibet (Taylor and Yin, 2009).',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip','Mostly strike-slip faults, and some normal faults.',NULL,NULL,NULL,NULL,NULL,NULL,'Taylor and Yin (2009) define the north-south extent of central Tibet by the Jinsha suture zone in the north and the Bangong-Nujiang suture zone to the south. The faults traces shown in this region are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009)','2015-07-15 14:18:00'),(137,'Northern Tibet Faults','Includes the Altyn Tagh and Kunlun faults.','China','Tibet; Northern Tibet',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strike-slip','Most faults are strike-slip (e.g., the left-slip Kunlun and Altyn Tagh faults) with some thrusting. ',NULL,NULL,NULL,NULL,NULL,NULL,'These faults are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009)','2015-07-15 14:18:00'),(138,'Tarim Basin Faults',NULL,'China','Tarim Basin',NULL,NULL,NULL,NULL,NULL,NULL,'6','9','Late Quaternary shortening in the western Tarim Basin is estimated to be 6-9 mm/yr (Thompson Jobe et al., 2017). This rate is based on OSL dating of fluvial terraces that cross active structures. The active structures include the Wuheshalu fold scarps (1.5 +4.7/-0.4 mm/yr), Kangsu South Thrust (~0.1 mm/yr), Kangsu West Thrust fault zone (dextral oblique slip rate of ~0.4-0.5 mm/yr and shortening rate of ~0.2 mm/yr), and Atushi fault (1.5 +0.5/-0.3 mm/yr of shortening following the listric fault model, and <0.1 mm/yr using simple line-length unfolding). ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'These faults are compiled by Taylor et al. (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor et al. (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009)','2017-12-06 13:32:26'),(139,'Eastern Tibet Faults','Includes Zhongdian Fault, Chenghai Fault, Longriba Fault, Ganzi Fault, Haiyuan Fault, Jiali Fault, Longmen Shan Fault Belt, and Red River Fault. ','China','Eastern Tibet',NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'These faults are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009); Shen et al. (2005); Xu et al. (2008)','2015-07-15 14:18:00'),(140,'North Frontal Thrust system','The fault system includes northeast-vergent thrust faults such as the Minle-Damaying Fault, Huangcheng-Taerzhuang Fault, Fengle Fault, and Kangningqiao Fault. Tectonically, the Kangniangqiao Fault and the Fengle Fault are considered as the eastern and western segments of the Southern Wuwei Basin Fault, respectively (xiong et al., accepted). ','China','Qilian Shan, Tibetan Plateau',NULL,NULL,NULL,NULL,NULL,NULL,'0.83','2.5','Shortening rate for the Minle-Damaying fault based on radiocarbon and OSL dating techniques is estimated to be 0.83-1.91 mm/yr (Xiong et al., accepted). The vertical slip rate for the Kangningqiao fault based on radiocarbon dating method is 0.44 ± 0.08 mm/yr (Ai et al., 2017). The shortening rate for the Fengle fault based on cosmogenic radionuclide method is ~2.5 mm/yr (Champagnac et al., 2010). This rate, however, has been argued to be overestimated due to uncertainties in age control and/or fault offset estimates (Hetzel, 2013; Hu et al., 2015).  ',NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The frontal thrusts of the North Frontal Thrust system (Fengle and Kangningqiao faults) define the basin-mountain boundary near the cities of Yongchang and Wuwei. ',NULL,'2017-12-05 11:33:11'),(147,'Irkeshtam Fault','The Pamir Front Thrust and the Irkeshtam Fault appear to share a common root in depth (Teshebaeva et al., 2014). ','Kyrgyzstan','Alai Valley; Pamir; Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The 2008 Nura earthquake (M6.6) caused dip-slip thrusting and sinistrally oblique thrusting on the kinematically connected Pamir Frontal Thrust and the Irkeshtam Fault (Teshebaeva et al. (2014).\r\n','Teshebaeva et al. [2014] found surface displacements and rupture along the Irkeshtam Fault by applying the InSAR technique using SAR images from ALOS and ENVISAT satellites. ',NULL,NULL,NULL,'Thrust','Sinistrally-oblique thrusting (Teshebaeva et al. (2014). ',NULL,NULL,NULL,NULL,'NE-SW',NULL,NULL,'Teshebaeva et al. (2014)','2015-07-15 14:18:00'),(148,'East Qinling Thrust System',NULL,'China','Sichuan Basin',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Styron, et al. (2010); Taylor, et al. (2009)','2015-07-15 14:18:00'),(150,'Makran Faults','These include Makran accretionary prism thrusts as well as the Panjgur, Hoshab, and Nai Rub fault system. ','Pakistan','Makran Range; Makran Accretionary Prism; Makran Flysch Basin; Baluchistan',NULL,NULL,NULL,NULL,'Based on preliminary GPS data, the Makran coast is moving rapidly (16-18 mm yr-1) southward indicating a locked offshore region (Khan et al., 2008).',NULL,NULL,NULL,NULL,'The 2013 Mw7.7 Baluchistan strike-slip earthquake occurred in the Makran accretionary prism of southern Pakistan.  South of the Baluchistan earthquake, a M8 earthquake in 1945 also ruptured the Makran megathrust (Barnhart et al., 2014).',NULL,NULL,NULL,NULL,'Thrust; Reverse','Mostly east–west oriented reverse faults.',NULL,NULL,NULL,NULL,NULL,NULL,'Some of these faults (e.g., Makran Thrust Belt) are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data. Some fault traces come from the Makran Flysch Basin and Chagai Volcanic Arc and Calc Alkaline Mag. Belt as shown in the tectonic map of Pakistan (Kazmi and Rana, 1982). Additionally, a few fault traces located in the Makran accretionary prism of southern Pakistan come from maps of Barnhart et al. (2014) and Lawrence et al. (1981). \r\n\r\nKinematic models of Bernard et al. (2010) predict the north-south convergence rates of 18.7-30 mm/yr for the Makran Range region. ','Styron, et al. (2010); Taylor, et al. (2009); Kazmi and Rana (1982); Barnhart et al. (2014); Lawrence et al. (1981); ','2015-07-15 14:18:00'),(151,'Muji Fault','The Muji Fault belongs to the Kongur Shan extensional system, and could be the northern extension of the Karakoram Fault (Chevalier et al., 2011b). ','Tajikistan, China','Western Tibet; Pamir; Western Xingiang',NULL,NULL,'4','5','The reported GPS rate is 4–5 mm/yr (Zubovich et al., 2010). \r\n',NULL,'4.5','11.1 ','Based on offset of two fluvial terraces, Chevalier et al. (2011b) estimated a range of Holocene slip rates between 4.5 ± 0.2 mm/yr and 11.1 ± 0.9 mm/yr or most probably a maximum of ~7 mm/yr for the Muji Fault. This rate is consistent with GPS data of 4–5 mm/yr (Zubovich et al., 2010) and the long-term geologic rate of 4.5-5.5 mm/yr (Robinson et al., 2010) across the northern Kongur Shan normal fault. ','The 2016 Mw 6.6 Muji earthquake ruptured the Muji fault, and is believed to be the first large instrumentally recorded earthquake on the fault. ','Multiple terraces in the Muji basin have been offset by the fault (Chevalier et al., 2011b).',NULL,NULL,NULL,'Strike-slip; Dextral (right lateral)','The western section is mostly strike-slip with a slight normal component and becomes predominantly normal to the east (Chevalier et al., 2011b).','SW',NULL,NULL,NULL,NULL,NULL,NULL,'Schurr, et al. (2014); Styron, et al. (2010); Taylor, et al. (2009); Chevalier, et al. (2011b); Zubovich et al. (2010)','2018-04-30 12:57:40'),(152,'Tazang Fault','Tazang Fault appears to be one of the main candidates to transfer slip from the Kunlun fault to shortening structures at the margin of the Tibetan Plateau (Chen et al., 1994; Kirby et al., 2000; Van der Woerd et al., 2002b). ','China','Tibet',NULL,'Tazang Fault appears as a sharp trace on satellite images. ',NULL,NULL,NULL,NULL,NULL,'1','From earthquake rupture magnitudes, Kirby et al. (2007) considered it likely that the Tazang Fault moves slowly at rates less than 1 mm/yr.\r\n',NULL,'Kirby et al. (2007) observed small catchments deflected in a left-lateral sense across the fault. ',NULL,NULL,NULL,'Sinistral (left lateral)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Kirby et al. (2007)','2015-07-15 14:18:00'),(153,'Bailong Jiang Fault System',NULL,'China','Tibet',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3','The fault is characterized by relatively low slip rates of <3 mm/yr (Yuan Daoyang, personal communication to Eric Kirby, 2006).',NULL,'The fault displaces bedrock interfluves (Kirby et al., 2007), however, there are no active fault traces recognizable in the field or on remote sensing between the eastern tip of the Kunlun fault and the western end of the Bailong Jiang fault.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Kirby et al. (2007)','2015-07-15 14:18:00'),(154,'Fergana Basin Faults',NULL,'Tajikistan, Kyrgyzstan, Uzbekistan','Fergana Basin; Tien Shan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thrust',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The faults traces shown in this region are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron, et al. (2010); Taylor, et al. (2009);','2015-07-15 14:18:00'),(155,'Kepingtage Thrust Zone',NULL,'China','Tarim Basin',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Allen et al. (1999)','2015-07-15 14:18:00'),(156,'Hindu Kush-Pamir Faults ','Previously mapped major faults in this region include the Badakhshan Fault zone (also known as Central Badakhshan Fault), Henjvan Fault, Darvaz-Karakul Fault, and the active dextral Gunt shear zone. \r\n\r\n','Afghanistan; Tajikistan','Hindu Kush-Pamir; Badakhshan; Wakhan Corridor',NULL,NULL,NULL,NULL,'Mohadjer et al. (2010) used the relative velocity between GPS sites in Peshawar and Khorog to place an upper bound of north-south shortening rate of 13.2 ± 1 mm/yr with 9.9 ± 1 mm/yr of sinistral shear on the total surface deformation south of Khorog. These rates could be the sum of slip on several faults or the integral of a continuous strain field in this region.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Normal','The primary sense of motion for most faults located in central Pamir as highlighted in the database map appears to be mostly normal (R. Gloaguen, personal communication, July 9, 2015).',NULL,NULL,NULL,NULL,NULL,NULL,'This region contains a diverse range of faults within the Hindu Kush and southwestern Pamir. Using satellite imagery, Ruleman et al. (2007) mapped and further examined several northwest-trending strike-slip faults that they characterized as (1) minor structures that are distinctly expressed in the landscape and that could be a significant contributor to seismic hazards (slip rates of 1-10 mm/yr) and (2) structures that have a subtle expression in the landscape or that have limited or poor expression in Quaternary deposits, but could possibly contribute to seismic hazards (with unknown slip rates).\r\n\r\nThe locations of fault traces that are between the Badakhshan Fault Zone and the Panj River are inferred (Schurr et al., 2014). These traces are characterized as likely active faults. \r\n \r\n\r\n\r\n\r\n','Ruleman at al. (2007); Schurr et al. (2014); R. Gloaguen, personal communication (July 9, 2015)','2015-07-16 09:51:57'),(157,'Himalaya Faults','Includes Tibrikot Fault, Ama Drime, Nyonno Ri detachments, Qusum Detachment Fault, Leo Pargil Detachment, the Kung Co Fault, and the Tingri Fault.','Pakistan; China; India','Himalaya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Fault traces include those located in the Himalayan Fold Belt and the Karakoram-Himalaya Crystalline and thrust zone of kazmi and Rana (1982).\r\n\r\n','kazmi and Rana  (1982); Styron et al. ( 2010); Taylor et al. (2009); Jessup et al. (2008); Saylor et al. (2010); Thiede et al. (2006);','2015-07-15 14:18:00'),(158,'Muree Thrust',NULL,'Pakistan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Jouanne et al. (2014)','2015-07-15 14:18:00'),(159,'Balakot-Bagh Thrust','The Balakot-Bagh fault is subdivided into several faults or fault segments with different geological, geomorphological, and geometrical characteristics, including the active Tanda fault as well as the Murree and Muzaffarabad faults (Kaneda et al., 2008). The name Balakat-Bagh fault is often used to refer to the causative fault of the 2005 Kashmir earthquake. ','Pakistan','Kashmir; Northwestern Himalaya',NULL,NULL,NULL,NULL,NULL,NULL,'1.2','4.1','A balanced cross-section yields a minimum\r\n1.2-1.7 mm/yr long-term slip rate (Meigs et al., 2012), lower than the 1.4 -4.1 mm/yr slip rate inferred from faulted Quaternary fluvial terraces (Kaneda et al., 2008). ','The Mw 7.6 earthquake on 8 October 2005 has been attributed to the Balakot-Bagh fault. Kondo et al. (2008) suggest an average interval of about 2000 years for the 2005 type events. Kaneda et al. (2008) suggests a recurrence interval of 1000-3300 years. ','Geomorphic features include scarps on terrace surfaces (Kaneda et al., 2008; Kondo et al., 2008).','Trenching across the fault at Nisar Camp site near Muzaffarabad has revealed the occurrence of past large earthquakes with the penultimate event dating back between 500-2200 years B.P. (Kondo et al., 2008; Jouanne et al., 2014).',NULL,NULL,'Thrust; Reverse',NULL,'30° dipping ramp','(Avouac et al., 2006) ',NULL,NULL,NULL,NULL,NULL,'Jouanne et al. (2014); Kondo et al. (2008); Kaneda et al. (2008); Meigs et al. (2012)','2015-07-15 14:19:05'),(160,'Mongolian-Gobi Altay Faults','This includes the Bogd Fault. ','Mongolia','Mongolian-Gobi Altay',NULL,NULL,NULL,NULL,NULL,NULL,'1.5','','Ritz et al. (1995) estimated a maximum rate of 1.2 mm/yr based on offset alluvial fans dated using cosmogenic radionuclide techniques. This rate was updated and revised later, yielding 1.5 ± 0.4 mm/yr.  ','The 1957 Gobi Altay M8.3 earthquake in southern Mongolia was associated with the rupture of several faults, including the Gurvan Bulag reverse fault (Prentice et al., 2002).',NULL,NULL,'Paleoseismic excavations across the Gurvan Bulag fault (25 km south of Bogd fault) by Prentice et al. (2002) imply that the recurrence intervals for surface faulting on the Gurvan and Bulag and Bogd faults are similar , on the order of several thousands of years but that the penultimate surface ruptures of the two faults did not occur during the 1957 Gobi Altay M8.3 earthquake in southern Mongolia.  ',NULL,'Strike-slip',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'These faults are compiled by Taylor and Yin (2009) and Styron et al. (2010) based on field observations or interpretations of satellite images and digital topography data including ASTER, LANDSAT, SPOT, CORONA, web-based Google Earth images and 90 m digital elevation models from the Shutter Radar Topography Mission (SRTM). Each individual structure was then digitally mapped using ESRI Arcmap software. Taylor and Yin (2009) only included the first-order active structures that have a strong morphological expression (see the reference for more details on the geomorphic criteria they used for identifying active structures).','Styron et al. (2010); Taylor et al. (2009); Tapponnier and Molnar (1979); Meigs et al.(2012) ','2015-07-23 15:32:34'),(161,'Raikhot Fault','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,' Reverse, Dextral (right lateral)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Marks the western boundary of the Nanga\r\nParbat spur, where it is believed to reactivate the Main Mantle Thrust and the Diamir shear zone in northern Pakistan.  ','Pecher et al. (2008)','2015-07-15 14:18:00'),(162,'Ilyak Fault',NULL,'Tajikistan','Tajik Basin ',NULL,NULL,'8','15','The Ilyak fault accommodates ~5 mm/yr of N-S shortening and 8–15 mm/yr of dextral slip (Metzger et al., 2020). ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Dextral',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The Ilyak fault marks a major tear fault, disconnecting the shortening in the Tajik basin fold‐thrust belt from the weakly deforming Tian Shan backstop (Metzger et al., 2020)',NULL,'2020-06-18 11:28:26');
